// find all of the link elements that need a mortgage referrer on the page
const mloReferrerIdRequestButtons = document.querySelectorAll(".js-mortgage-loan-officer-id a");
mloReferrerIdRequestButtons.forEach((mloReferrerIdRequestButton) => setMortgageLoanOfficerQueryParam(mloReferrerIdRequestButton));

// find all of the link elements that need a mortgage phone number on the page
const mloPhoneRequestButtons = document.querySelectorAll(".js-mortgage-loan-officer-phone a");
mloPhoneRequestButtons.forEach((mloPhoneRequestButton) => setMortgageLoanOfficerPhoneNumber(mloPhoneRequestButton));

function getLocalStorageObject(key) {
  // get the local storage value
  return JSON.parse(window.localStorage.getItem(key));
}

function setMortgageLoanOfficerQueryParam(mloElementRequestingParameter) {
  const localStorage = getLocalStorageObject("profile");
  if (localStorage === null) return;
  if (localStorage["email"] === (undefined || null || "")) return;

  // get the current url and test to see if the url is relative or absolute
  const baseUrl = new URL(`${window.location.protocol}//${window.location.hostname}/`);
  const existingUrlString = mloElementRequestingParameter.getAttribute("href");
  const absoluteUrlRegex = new RegExp("((http|https|ftp)://)");
  const absoluteUrlTest = absoluteUrlRegex.test(existingUrlString);

  let existingUrl;

  // add a base if the url is relative
  if (absoluteUrlTest) existingUrl = new URL(existingUrlString);
  if (!absoluteUrlTest) existingUrl = new URL(existingUrlString, baseUrl);

  // get current query parameters (to preserve other parameters that might have been set)
  const mloQueryParams = new URLSearchParams(existingUrl.search);

  // update the parameters and store the updated url in a new variable
  mloQueryParams.set("referrerID", localStorage["email"]);
  existingUrl.search = `?${mloQueryParams}`;
  const updatedUrl = existingUrl.toString();

  // set the new url on the button
  mloElementRequestingParameter.setAttribute("href", updatedUrl);

  // this line is just for demo purposes, to show that the url is being updated
  //mloElementRequestingParameter.innerText = updatedUrl;
}

function setMortgageLoanOfficerPhoneNumber(mloElementRequestingParameter) {
  const localStorage = getLocalStorageObject("profile");
  if (localStorage === null) return;
  if (localStorage["phone"] === (undefined || null || "")) return;

  const phoneNumber = localStorage["phone"];

  // set the new url and href value on the button
  mloElementRequestingParameter.setAttribute("href", `tel:${phoneNumber}`);
  mloElementRequestingParameter.innerText = phoneNumber;
}



(function () {

  //JS runs on page load to avoid scroll jump and page flickering
  let accLink = "";
  let accLinkTruistTab = "";
  if (window.location.hash) {
    accLink = window.location.hash;
    accLinkTruistTab = window.location.hash;
    //check for Truist/Fill tabs ID
    if (accLink.length > 0) {
    const intIndex = accLink.lastIndexOf('-');
      const strTruistTabID = accLink.slice(0, intIndex);
      window.location.hash = "";
        if ($(strTruistTabID).hasClass('ori-tabs') || $(strTruistTabID).hasClass('comparison__container')) {
          accLink = strTruistTabID;
      }
    }
  }

    setTimeout(function () {
     if ($(accLink).length > 0) {
        function activateOpen() {
          if (accLink === null || accLink === "") {
            return;
          } else {
            scrollTo();
          }
        }
        function openAccordion() {
          $(accLink).find("button").trigger('click');
         }

        function openTruistTabs() {
          const intIndex = accLinkTruistTab.lastIndexOf('-');
          const strTruistSelectTabID = parseInt(accLinkTruistTab.slice(intIndex + 1));
          const targetTab =   $(accLink).find("[data-order='" + strTruistSelectTabID + "']").find('button');

          targetTab.trigger('click');
          getTabScroll($(accLink), strTruistSelectTabID);

        }

        function openFillTabs() {
             const intIndex = accLinkTruistTab.lastIndexOf('-');
             const strTruistSelectTabID = parseInt(accLinkTruistTab.slice(intIndex + 1));

             if ($(accLink).find(".display--desktop-fill-tabs").css('display') != 'none') {
                 const targetTab =   $(accLink).find("ul li:nth-child(" + (strTruistSelectTabID + 1) + ")").eq(0);
                 setTimeout(function() {
                     targetTab.trigger('click');
                 }, 1500);
             }


             if ($(accLink).find(".display--mobile-fill-tabs").css('display') != 'none') {
                 const targetTab =   $(accLink).find(".fill-tabs--content-mobile").eq(0);
                 setTimeout(function() {
                     targetTab.slick("slickGoTo", strTruistSelectTabID);
                 }, 1500);
             }

        }

        function getTabScroll(target, strTruistSelectTabID) {
          var $srlWidth = 0;
          const $listParent = $(target).find('.js-ori-tabs__list');
          const $listParentChild = $listParent.find('li');

          if (strTruistSelectTabID < $listParentChild.length) {
          for (var i=0; i < $listParentChild.length; i++) {
              if (i < strTruistSelectTabID)
                  $srlWidth = $srlWidth + $listParentChild[i].offsetWidth;
          }

          $listParent.animate({
            scrollLeft: $srlWidth - 50
          });
          }
        }

    function scrollTo() {

         $("html, body").animate(
            {
              scrollTop: $(accLink).offset().top
            },
            1500, function () {
               window.location.hash = accLink;

               if ($('.sticky').length > 0)
                   $('.sticky').removeClass('sticky');

               if ($('.subpage-navigation').length > 0)
                   $('.subpage-navigation').css('position', 'relative');
         });


        if($(accLink).hasClass('accordion-card-header'))
              openAccordion();
        if($(accLink).hasClass('ori-tabs'))
               openTruistTabs();
        if($(accLink).hasClass('comparison__container'))
             openFillTabs();


         }
        activateOpen();
     }

    // click function on anchor links where we have anchor id
    $('.truist-smooth-scroll a[href^="#"], a[class*="truist-smooth-scroll"]').click(
      function (e) {
        if (this.hash !== "") {
          e.preventDefault();
          var anchorHash = this.hash;
          $("html, body").animate(
            {
              scrollTop: $(anchorHash).offset().top
            },
            1500, function () {
                 window.location.hash = anchorHash;
                 $(anchorHash + " .author-rte-styling h2").attr('tabindex','0').focus();
                 setTimeout(function() {
                    $(anchorHash + " .author-rte-styling h2").removeAttr('tabindex');
                }, 3000);
          });
        }
        return false;
      }
    );

  }, 1000);

 })();

'use strict';

window.PositionResolver = () => {
  const DEFAULT_GEOLOCATION_TIMEOUT = 8000;
  const GEOCODER = new google.maps.Geocoder;

  const DEFAULT_GEOCODER_REQUEST_OPTIONS = {
    componentRestrictions: {
      country: 'US'
    }
  };

  let options = {                   // TODO:  Revisit this...
    preprocess: ( ta, tap ) => ta   // (1) Do we really need a preprocess option, as opposed to letting the caller tweak resolve data afterward?
  };                                // (2) If so, might it not be better to support tweaking all properties, instead of textAddress only?

  //---------------------------------------
  const _private = {
    // Generate promises for both lat,lng and text address:
    getPositionData: ( input = {} ) => {   // possible input properties: lat, lng, textAddress, options
      // Declare, init, normalize:
      let tll;
      try { tll = new truistLatLng( input ); } catch ( err ) {}

      let nrmlTextAddress = String( input.textAddress || '' ).trim().replace( /\s+/g, ' ' );
      Object.assign( options, input.options );

      // Promise for lat,lng:
      let latlngPromise = new Promise( resolve => {
        if ( tll ) {
          resolve( { latlng: tll } );                                     // easy case: input already contains valid lat,lng -- resolve instantly
        }
        else if ( nrmlTextAddress ) {   // TODO: add sanity-check to cancel .geocode() iff repeating prior search
          GEOCODER.geocode( { address: nrmlTextAddress, ...DEFAULT_GEOCODER_REQUEST_OPTIONS } )   // no valid lat,lng provided -- attempt to geocode textAddress
            .then( _private.processGeocodeResponse )
            .then( resolve )                                              // geocoding of textAddress succeeded -- resolve w/ processed result
            .catch( () => resolve( _private.getGeoLocationPromise() ) );  // geocoding of textAddress failed -- use geolocation instead
        }
        else {
          resolve( _private.getGeoLocationPromise() );                    // neither lat,lng nor textAddress given -- use geolocation instead
        }
      } );

      // Promise for text address:
      let textAddressPromise = new Promise( ( resolve, reject ) => {
        latlngPromise
          .then( latlngData => {
            if ( latlngData.textAddress ) {
              resolve( latlngData );                                                      // latlngPromise resolved with geocode result; use the same here, for consistency
            }
            else if ( nrmlTextAddress ) {
              resolve( Object.assign( latlngData, { textAddress: nrmlTextAddress } ) );   // otherwise, resolve with textAddress provided as input
            }
            else {                      // TODO: add sanity-check to cancel .geocode() iff repeating prior search
              tll = latlngData.latlng;

              GEOCODER.geocode( { location: { lat: tll.lat, lng: tll.lng } } )            // other-otherwise, attempt to reverse-geocode lat,lng
                .then( _private.processGeocodeResponse )
                .then( resolve )                                                          // reverse-geocoding succeeded -- resolve w/ processed result
                .catch( reject );                                                         // reverse-geocoding failed -- reject
            }
          } )
          .catch( () => resolve( { textAddress: nrmlTextAddress } ) );
      } );

      // Return both promises:
      return {
        latlngPromise: latlngPromise,
        textAddressPromise: textAddressPromise
      }
    },

    // Private helper method -- handle results from geocoder:
    processGeocodeResponse: response => {
      let result = response.results[0];
      let ll = result.geometry.location;

      let textAddressParts = result.address_components.reduce( ( acc, cur ) => {
        acc[ cur.types[0] ] = cur.short_name;
        return acc
      }, {} );

      let textAddress = result.formatted_address.replace( textAddressParts.plus_code, '' ).trim();

      return {
        latlng: new truistLatLng( ll.lat(), ll.lng() ),
        textAddress: options.preprocess( textAddress, textAddressParts ),
        textAddressParts: textAddressParts,
        vendorData: result
      };
    },

    // Generate promise for device-based geolocation:
    getGeoLocationPromise: () => new Promise( ( resolve, reject ) => {
      try {
        navigator.geolocation.getCurrentPosition(
          pos => {                                  // getCurrentPosition success handler
            let coords = pos.coords;

            resolve( {
              latlng: new truistLatLng( coords.latitude, coords.longitude ),
              deviceData: pos
            } );
          },
          reject,                                   // getCurrentPosition error handler
          { timeout: DEFAULT_GEOLOCATION_TIMEOUT }  // getCurrentPosition options (TODO: enable option to override this)
        );
      }
      catch ( err ) {
        reject( err );
      }
    } )
  };

  //---------------------------------------
  const _public = {
    getPositionData: _private.getPositionData,
    getGeoLocationPromise: _private.getGeoLocationPromise
  };

  return _public;
}
/* Append DC string parameter to CTA destination URL */
(function ($) {

    //CTA Enhancement - to append promo key pair value from current URL to CTA destination href | US979908
    var addPromoKye = [], addPromoValue = [],
        queryPromoKeys = ["CampIDMaj", "CampIDMin", "cid", "icid", "rcode", "odeid"],
        searchParams = new URLSearchParams(window.location.search);

    $('a.gCTAcommon').on('click', function (e) {
        var ctaDestinationURL = $(this).attr('href');
        var ctaPromoParamFlag = $(this).data('enable-promo-param');
        var ctaDestinationURLnew, paramKeyPair = {}, paramKeyPairStr;
        if (ctaPromoParamFlag == true) {
            for (var i = 0; i < queryPromoKeys.length; i++) {
                if (searchParams.has(queryPromoKeys[i])) {
                    addPromoKye.push(queryPromoKeys[i]);
                    addPromoValue.push(searchParams.get(queryPromoKeys[i]));
                }
            }
            for (var j = 0; j < addPromoKye.length; j++) {
                paramKeyPair[addPromoKye[j]] = addPromoValue[j];
            }

            paramKeyPairStr = Object.keys(paramKeyPair).map(function (key) {
                return key + '=' + paramKeyPair[key];
            }).join('&');
            ctaDestinationURLnew = ctaDestinationURL + (ctaDestinationURL.match(/\?/) ? '&' : '?') + paramKeyPairStr;
            $(this).attr('href', ctaDestinationURLnew);
        } else {
            $(this).attr('href', ctaDestinationURL);
        }
    });

})(jQuery);
