function addDynamicComponentId() {
    $('.input-hidden-container').each(function () {
        var componentID, desktopClass, labelMobile, mobileClass, labelDesktop;
        componentID = "#" + $(this).find('.componentclass').attr('value');
        desktopClass = $(this).find('.desktopclass').attr('value');
        labelMobile = $(this).find('.labelMobile').attr('value');
        mobileClass = $(this).find('.mobileClass').attr('value');
        labelDesktop = $(this).find('.labeldesktop').attr('value');

        if ($(window).width() <= 896) {
            $(componentID).removeClass(desktopClass).addClass(mobileClass);
            $(componentID).attr("aria-label", labelMobile);
        } else {
            $(componentID).removeClass(mobileClass).addClass(desktopClass);
            $(componentID).attr("aria-label", labelDesktop);
        }
    });
}

