function generateGridCardLayout(DLLGlobalVariables) {
    var DLLCardData = DLLGlobalVariables.DLLCardData;
    var cardOffsetIndex = DLLGlobalVariables.cardIndex;
    var targetURL = DLLCardData[cardOffsetIndex].dllTargetURL;
    if (targetURL === "") {
        targetURL = DLLCardData[cardOffsetIndex].pagePath;
    }
    var layoutContent = "";

    layoutContent += "<div tabindex='-1' id='cardIndex_" + cardOffsetIndex + "' role='listitem' class='grid-container  " + (DLLGlobalVariables.showImageIcons ? DLLCardData[cardOffsetIndex].iconStyle : "") + " " + DLLGlobalVariables.gridBackgroundCSSClass + "'>";
    layoutContent += "<a href='" + targetURL + "'>";
    layoutContent += "<div class='article-title' role='heading' aria-level='3'>" + DLLCardData[cardOffsetIndex].dllTitle + "</div>";
    layoutContent += "<div class='article-summary'> ";
    layoutContent += "<div class='p1'><span class='s1'>" + DLLCardData[cardOffsetIndex].dllDescription + " </span></div>";
    layoutContent += "</div></a></div>";
    return layoutContent;
}
function generateListViewCardLayout(DLLGlobalVariables) {
    var DLLCardData = DLLGlobalVariables.DLLCardData;
    var cardOffsetIndex = DLLGlobalVariables.cardIndex;
    var targetURL = DLLCardData[cardOffsetIndex].dllTargetURL;
    if (targetURL === "") {
        targetURL = DLLCardData[cardOffsetIndex].pagePath;
    }
    var layoutContent = "";
    var needBorderClass = DLLGlobalVariables.showListViewBorders;
    if (cardOffsetIndex === 0) {
        needBorderClass = false;
    }
    layoutContent += " <div tabindex='-1' role='listitem' id='cardIndex_" + cardOffsetIndex + "' class='article list-article" + (needBorderClass ? " line-border-article" : "") + "' >";

    if (DLLGlobalVariables.showImageIcons) {
        layoutContent += "<div class='banner-icon '><div class='" + DLLCardData[cardOffsetIndex].iconStyle + "'></div></div>";
    }

    if ((DLLGlobalVariables.showListViewImages) && (DLLCardData[cardOffsetIndex].dllImageURL.length > 0)) {
        layoutContent += "<div class='banner-image'><img class='img-fluid'  alt='" + DLLCardData[cardOffsetIndex].dllImageAltText + "' src='" + DLLCardData[cardOffsetIndex].dllImageURL + "' /></div>";
    }

    layoutContent += "<div class='inner'>";
    layoutContent += " <div role='heading' aria-level='3' class='article-title'>";
    layoutContent += "<a href='" + targetURL + "'>" + DLLCardData[cardOffsetIndex].dllTitle + "</a>";
    layoutContent += "</div>";

    if (DLLGlobalVariables.showListViewDates) {
        layoutContent += "<p class='date-desc'>" + DLLCardData[cardOffsetIndex].publishDate + "</p>";
    }

    if ((DLLGlobalVariables.showListViewTags) && DLLCardData[cardOffsetIndex].tags.length > 0) {
        layoutContent += "<p class='tag-desc'>" + parseTags(DLLCardData[cardOffsetIndex].tags) + "</p>";
    }

    layoutContent += "<div>" + DLLCardData[cardOffsetIndex].dllDescription + "</div>";
    layoutContent += "</div>";
    layoutContent += "</div>";
    return layoutContent;
}

