function generateLoadMoreCardPage(loadMoreButtonID, componentID, reLoad) {

    dllComponentGlobalVariables = DLLCollection[componentID];
    var layoutContent = "";
    var i;
    var totalRows = Math.ceil(dllComponentGlobalVariables.totalCardsPerLoad / dllComponentGlobalVariables.itemsPerRow);

    loadMorePerPageCount = 0;
    var newCardID = dllComponentGlobalVariables.cardIndex;

    for (i = 0; i < totalRows; i += 1) {
        layoutContent += generateLoadMoreItems(dllComponentGlobalVariables);
    }
    if (reLoad) { // if true, then called from Load More button.. append to existing ul
        $("#" + dllComponentGlobalVariables.componentID + " .dll-component-wrapper").append(layoutContent);
        $("#cardIndex_" + newCardID).focus();
        if (dllComponentGlobalVariables.cardIndex >= dllComponentGlobalVariables.totalCardsFetched) {
            $("#" + dllComponentGlobalVariables.componentID + " .global-load-more-wrapper").addClass("hide-component");
        }

    } else {
        return layoutContent;
    }
}

function generateLoadMoreItems(dllComponentGlobalVariables) {
    var layoutContent = "";
    var i;
    if (dllComponentGlobalVariables.cardIndex >= dllComponentGlobalVariables.totalCardsFetched) {
        return "";
    }
    for (i = 0; i < dllComponentGlobalVariables.itemsPerRow; i += 1) {
        if (dllComponentGlobalVariables.contentPresentationView === "GridView") {
            layoutContent += generateGridCardLayout(dllComponentGlobalVariables);
        }
        if (dllComponentGlobalVariables.contentPresentationView === "TitleView") {
            layoutContent += generateTitleViewLayout(dllComponentGlobalVariables);
        }
        if (dllComponentGlobalVariables.contentPresentationView === "Thumbnail") {
            layoutContent += generateThumbnailCardLayout(dllComponentGlobalVariables);
        }
        if (dllComponentGlobalVariables.contentPresentationView === "ListView") {
            layoutContent += generateListViewCardLayout(dllComponentGlobalVariables);
        }
        if (dllComponentGlobalVariables.contentPresentationView === "Tombstone") {
            layoutContent += generateTombstoneCardLayout(dllComponentGlobalVariables);
        }
        loadMorePerPageCount += 1;
        dllComponentGlobalVariables.cardIndex += 1;
        if (dllComponentGlobalVariables.cardIndex >= dllComponentGlobalVariables.totalCardsFetched || loadMorePerPageCount >= dllComponentGlobalVariables.totalCardsPerLoad) {
            break;
        }
    }
    return layoutContent;
}

function renderLoadMoreEndWrapper(dllComponentGlobalVariables) {
    var endWrapperContent = "";
    endWrapperContent += "<div class='global-load-more-wrapper'>";
    endWrapperContent += "<div class='global-load-more'>";
    endWrapperContent += "<a role='button' href='javascript:void(0)' id='loadmore_" + dllComponentGlobalVariables.componentID + "' aria-label='" + dllComponentGlobalVariables.CTAAltText + "'    onclick=\"generateLoadMoreCardPage(this.id,'" + dllComponentGlobalVariables.componentID + "',true);return false\" class='loadMore " + dllComponentGlobalVariables.ctaBackgroundCSSClass + " gl-align-center font-color-white' >" + dllComponentGlobalVariables.CTAText + "</a>";
    endWrapperContent += "</div></div>";
    return endWrapperContent;
}
function renderPaginationLayout(componentID) {
    var viewLayoutClass = "";
    var windowWidth = $("#" + componentID).parent().width();
    var dllComponentGlobalVariables = DLLCollection[componentID];
    // Add additional class to wrapper for partial view override
    if (dllComponentGlobalVariables.contentPresentationView === "GridView") {
        viewLayoutClass = "gridLayout-class";
    }
    if (dllComponentGlobalVariables.contentPresentationView === "TitleView") {
        viewLayoutClass = "titleLayout-class";
    }
    if (dllComponentGlobalVariables.contentPresentationView === "Thumbnail") {
        viewLayoutClass = "thumbnailLayout-class";
    }
    if (dllComponentGlobalVariables.contentPresentationView === "ListView") {
        viewLayoutClass = "listviewLayout-class";
    }
    if (dllComponentGlobalVariables.contentPresentationView === "Tombstone") {
        viewLayoutClass = "tombstoneLayout-class";
    }

    if ($(window).width() < 1024 && $(window).width() >= 768) {
        dllComponentGlobalVariables.itemsPerRow = 2;
    }

    if (windowWidth < 768 && windowWidth > 600) {
        dllComponentGlobalVariables.itemsPerRow = 2;
    }

    if (windowWidth < 458) {
        dllComponentGlobalVariables.itemsPerRow = 1;
    }
    // check if items per row defined by author is lesser than calculated
    if (dllComponentGlobalVariables.totalCardsPerLoad < dllComponentGlobalVariables.itemsPerRow) {
        dllComponentGlobalVariables.itemsPerRow = dllComponentGlobalVariables.totalCardsPerLoad;
        totalSlides = Math.ceil(dllComponentGlobalVariables.totalCardsFetched / dllComponentGlobalVariables.itemsPerRow);
    }
    var layoutContent = "";
    if (dllComponentGlobalVariables.contentPresentationView === "TitleView") {
        layoutContent += generateTitleViewHeaderLayout(dllComponentGlobalVariables.componentID);
    }
    if ((dllComponentGlobalVariables.contentPresentationView === "TitleView") || (dllComponentGlobalVariables.contentPresentationView === "ListView")) {
        dllComponentGlobalVariables.itemsPerRow = dllComponentGlobalVariables.totalCardsPerLoad;
        dllComponentGlobalVariables.masterCardsPerRow = dllComponentGlobalVariables.totalCardsPerLoad;
    }
    layoutContent += "<div  id='" + componentID + "-DLL-pagination-Container' class='dll-pagination-container dll-container  my-" + dllComponentGlobalVariables.itemsPerRow + "'>";
    layoutContent += "<div class='layout-wrapper dll-component-wrapper " + viewLayoutClass + "' data-attribute='pagination' data-numberOfCards='" + dllComponentGlobalVariables.itemsPerRow + "' data-numberOfPages='" + dllComponentGlobalVariables.totalPages + "'></div> ";
    layoutContent += "<div role='navigation' aria-label='Cards' class='text-center'><ul id='" + componentID + "-pagination-dll' class='pagination dll-featured'></ul></div>";
    layoutContent += "</div>";
    return layoutContent;
}

function cardTemplateGeneration(dllComponentGlobalVariables) {
    var noOfPagesOnScreen = Math.ceil(dllComponentGlobalVariables.totalCardsFetched / dllComponentGlobalVariables.totalCardsPerLoad);
    var noOfCardsOnScreen = dllComponentGlobalVariables.totalCardsPerLoad;
    var i;
    var j;
    var k;
    dllComponentGlobalVariables.cardIndex = 0;
    var totalRows = Math.ceil(dllComponentGlobalVariables.totalCardsPerLoad / dllComponentGlobalVariables.itemsPerRow);
    var layoutContent = "";
    var cardsAddedToPage = 0;
    for (i = 1; i <= noOfPagesOnScreen; i += 1) {
        $("#" + dllComponentGlobalVariables.componentID + " .layout-wrapper").append("<div class='card-deck page' role='list' id='page" + i + "'></div>");
        layoutContent = "";
        cardsAddedToPage = 0;
        for (j = 0; j < totalRows; j += 1) {
            if (cardsAddedToPage >= dllComponentGlobalVariables.totalCardsPerLoad || dllComponentGlobalVariables.cardIndex >= dllComponentGlobalVariables.totalCardsFetched) {
                break;
            }

            for (k = 0; k < dllComponentGlobalVariables.itemsPerRow; k += 1) {
                if (cardsAddedToPage >= dllComponentGlobalVariables.totalCardsPerLoad || dllComponentGlobalVariables.cardIndex >= dllComponentGlobalVariables.totalCardsFetched) {
                    break;
                }
                if (dllComponentGlobalVariables.contentPresentationView === "GridView") {
                    layoutContent += generateGridCardLayout(dllComponentGlobalVariables)
                }
                if (dllComponentGlobalVariables.contentPresentationView === "Thumbnail") {
                    layoutContent += generateThumbnailCardLayout(dllComponentGlobalVariables)
                }
                if (dllComponentGlobalVariables.contentPresentationView === "ListView") {
                    layoutContent += generateListViewCardLayout(dllComponentGlobalVariables);
                }
                if (dllComponentGlobalVariables.contentPresentationView === "Tombstone") {
                    layoutContent += generateTombstoneCardLayout(dllComponentGlobalVariables);
                }
                if (dllComponentGlobalVariables.contentPresentationView === "TitleView") {
                    layoutContent += generateTitleViewLayout(dllComponentGlobalVariables);
                }
                dllComponentGlobalVariables.cardIndex += 1;
                cardsAddedToPage += 1;
            }
        }
        $("#" + dllComponentGlobalVariables.componentID + " #page" + i + ".card-deck").append(layoutContent);
    }
}
/*dynamic card generation ends*/

/*pagination plugin init starts*/
function cardPagination(dllComponentGlobalVariables) {
    var componentID = "#" + dllComponentGlobalVariables.componentID;
    var componentID_withoutHash = dllComponentGlobalVariables.componentID;
    $(componentID + "-pagination-dll").pagination({
        items: dllComponentGlobalVariables.totalCardsFetched, // Number of cards in results
        itemsOnPage: dllComponentGlobalVariables.totalCardsPerLoad, // number of cards per page
        pages: 0,
        edges: 2, // Number of ellipsis
        displayedPages: 3, // numberof page to display for ellipsis
        currentPage: 1,
        cssStyle: "light-theme",
        onInit: function (currentPage) {
            $(componentID + " .card-deck.page:first").addClass("page-active");
            $('.simple-pagination').find('li.disabled span').attr({
                'aria-disabled': 'true'
            });
            $(componentID + "-pagination-dll .disabled span").removeAttr("tabIndex");
            $(componentID + "-pagination-dll span.current").removeAttr("tabIndex");
            $(componentID + "-pagination-dll span").removeAttr("aria-current");
            $(componentID + "-pagination-dll .active span.current").attr({
                'aria-current': 'page'
            });
            $(componentID + "-pagination-dll li span").removeAttr("aria-label");
            $(componentID + "-pagination-dll .page-link").removeAttr("aria-label");
            $(componentID + "-pagination-dll .prev").attr({
                "role": "button"
            });
            $(componentID + "-pagination-dll .next").attr({
                "role": "button"
            });
        },
        onPageClick: function (pageNumber) {
            $(componentID + " .page").removeClass("page-active");
            var page = componentID + " #page" + pageNumber;
            $(page).addClass("page-active");
            $(page).find('a:first').focus();
            $('.simple-pagination').find('li.disabled span').attr({
                'aria-disabled': 'true'
            });
            $("html, body").animate({
                scrollTop: $(componentID).offset().top
            }, 0);
            $(componentID + "-pagination-dll .disabled span").removeAttr("tabIndex");
            $(componentID + "-pagination-dll span.current").removeAttr("tabIndex");
            $(componentID + "-pagination-dll span").removeAttr("aria-current");
            $(componentID + "-pagination-dll .active span.current ").attr({
                'aria-current': 'page'
            });
            $(componentID + "-pagination-dll li span").removeAttr("aria-label");
            $(componentID + "-pagination-dll .page-link").removeAttr("aria-label");
            $(componentID + "-pagination-dll .prev").attr({
                "role": "button"
            });
            $(componentID + "-pagination-dll .next").attr({
                "role": "button"
            });
            $("#DynamicListContents_" + componentID_withoutHash + " .dll-current-page").html(pageNumber);
        }
    });
}
function generateTitleViewLayout(DLLGlobalVariables) {
    var DLLCardData = DLLGlobalVariables.DLLCardData;
    var cardOffsetIndex = DLLGlobalVariables.cardIndex;
    var targetURL = DLLCardData[cardOffsetIndex].dllTargetURL;
    if (targetURL === "") {
        targetURL = DLLCardData[cardOffsetIndex].pagePath;
    }
    return "<div class='title-link' id='cardIndex_" + cardOffsetIndex + "' tabindex='-1' > <a href='" + targetURL + "' title=''>" + DLLCardData[cardOffsetIndex].dllTitle + "</a></div>";
}

function generateTitleViewHeaderLayout(componentID) {
    return "<div class='title-list-wrapper'>";
}

function generateTitleViewFooterLayout() {
    return "</div>";
}
function generateTombstoneCardLayout(DLLGlobalVariables) {
    var layoutContent = "";
    var DLLCardData = DLLGlobalVariables.DLLCardData;
    var cardOffsetIndex = DLLGlobalVariables.cardIndex;

    layoutContent += "<div tabindex='-1' role='listitem' id='cardIndex_" + cardOffsetIndex + "' class='tombstone-container'>";

    layoutContent += "<div class='tombstone-photo'>"
    layoutContent += "<img class='tombstone-img-responsive image-center'  src='" + DLLCardData[cardOffsetIndex].dllImageURL + "' alt='" + DLLCardData[cardOffsetIndex].dllImageAltText + "'>"
    layoutContent += "</div>";

    layoutContent += "<div class='tombstone-desc'>"
    layoutContent += "<div class='tombstone-card-title'>" + DLLCardData[cardOffsetIndex].dllTitle + "</div>";
    layoutContent += "<div class='tombstone-card-description'>" + DLLCardData[cardOffsetIndex].dllDescription + "</div>";
    layoutContent += "<ul class='tombstone-list-item'>";
    if (DLLCardData[cardOffsetIndex].bulletOne.trim().length > 0)
        layoutContent += "<li>" + DLLCardData[cardOffsetIndex].bulletOne + "</li>";
    if (DLLCardData[cardOffsetIndex].bulletTwo.trim().length > 0)
        layoutContent += "<li>" + DLLCardData[cardOffsetIndex].bulletTwo + "</li>";
    if (DLLCardData[cardOffsetIndex].bulletThree.trim().length > 0)
        layoutContent += "<li>" + DLLCardData[cardOffsetIndex].bulletThree + "</li>";
    if (DLLCardData[cardOffsetIndex].bulletFour.trim().length > 0)
        layoutContent += "<li>" + DLLCardData[cardOffsetIndex].bulletFour + "</li>";
    layoutContent += "</ul>";
    layoutContent += "<div class='published-date'>" + DLLCardData[cardOffsetIndex].footerNote + "</div>";

    layoutContent += "</div>";

    layoutContent += "</div>";
    return layoutContent;
}
