 $(document).ready(function(){
	 
	 if($('body').hasClass("advisor-individual-page") || $('body').hasClass("advisor-team-page")){
			var path = window.location.pathname;
			var nmlsr = $(".profile-info .profile-heading .nmlsr").text().trim();
			var name = $(".profile-info .profile-name").text().trim();
			var email = $(".profile-info .profile-heading .profile-email").text().trim();
			var phone = $(".profile-info .profile-heading .phone").text().trim();
			var fax = $(".profile-info .profile-heading .fax").text().trim();
			var image = $(".profile-info .profile-media .profile-image").attr("src");
			if($('body').hasClass("advisor-team-page")){
				image = $(".team__image img").attr("src");
			}
			var profile = { 'path': path, 'name':name, 'nmlsr': nmlsr, 'email':email, 'phone':phone, 'image':image };
			localStorage.setItem('profile', JSON.stringify(profile));
			
			$( ".profile-info .apply-now" ).click(function() {
				 applynow(this);
			 });
		}
		
	 function applynow(elem){	 
		 var profile = localStorage.getItem('profile');
		 var target = $(elem).attr("target");
		 profile = JSON.parse(profile)
		 console.log('profile: ', profile);	
		 var params = $(elem).attr("href");	 		 
		 if(profile.email){
			 params += profile.email.replace("@","%40");
		 }
		 if(target == '_blank'){
	         	window.open(params, '_blank');
	     }else{
	         	 window.open(params, '_self');
	     }
	 }
 });





