//loadmore in recommended resources
  $(function() {

    var max_card = $('.resource-center .resources-container').attr('data-max');
    var lengthToCut = 57;
 
   $(".resources-container .resources").slice(0,max_card).show();

   $(".load-more-btn").click(function (e) {
                $(".resources-container .resources:hidden").slice(0, max_card).slideDown();
                if ($(".resources-container .resources:hidden").length == 0) {
                    $(".load-more-btn").fadeOut();
                    $(this).closest(".load-more-button").fadeOut();
                  }
            });

    $(".resources-container .resources").each(function() {
      var dots = $(this).find('.resourceTitle').text();
       if(dots.length >= lengthToCut) {
           var index = dots.substring(0, lengthToCut);
           $(this).find('.resourceTitle').text(index.substring(0, index.lastIndexOf(" "))+ "...")
             //  $(this).find('.resourceTitle').text(dots.substring(0,lengthToCut+1)+ "...");
       }
    });
     
    $("a.telno-profile").text(function(i, text) {
      text = text.replace(/(\d{3})(\d{3})(\d{4})/, "$1-$2-$3");
      return text;
    });

    $('.profilename-designationCode .profile-title').contents().filter(function() {
      return this.nodeType === 3;
      }).replaceWith(function() {
          return this.nodeValue.replace(/[™®©]/g, '<sup>$&</sup>');
    });

    setTimeout(function() {
      $('.gm-control-active').removeAttr('title'); }  , 5000);
      
 })
