$(document).ready(function () {
    var jsonUrl = $('#onupQuiz').val();
    if ( !jsonUrl ) { return; }   // bail out if url is blank, since .ajax() call below with blank url would request the page again!

    var OnUpQuiz_SelectedAnswers = [];
    var quizContainer = document.getElementById('quiz');
    var currentQuestion, questionCount, mobileNumberFmt, mobileTotalQstFmt;
    var progressbar = document.getElementById('quiz-progress');
    var quiz_heading = "";

    if (document.getElementById("quiz-heading") != null)
	     quiz_heading = document.getElementById("quiz-heading").value;

    $('.question-container').hide();

    $('.startQuiz').click(function(){
        $('.onupQuiz-intro').hide();
       $('.question-container').slideDown("linear");
        var cData = new Object();
        cData.events = "event38";
        cData.toolFlowName = $("#toolFlowName").val();
        marTech.trackAction(cData);
        setTimeout(function (){
            quizContainerElement = document.querySelector(".quiz-container");
            quizContainerElement.scrollIntoView();
        }, 200);
    });

    $.ajax( {
      'async': false,
      'global': false,
      'url': jsonUrl,
      'dataType': "json",
      'success': jsonResponse => {
        $('.controlsSec').removeClass('hidden');
        $('.quiz-container')[0] && showQuestions( jsonResponse.questions, quizContainer );
      },
      error: function (xhr, status, error) {
          //Custom Error handler here
      }
    } );

    function showQuestions(questions, quizContainer) {
        // we'll need a place to store the output and the answer choices
        var output = [];
        var answers;
        var totalQuestions = questions.length;

        // for each question...
        for (var i = 0; i < totalQuestions; i++) {

            // first reset the list of answers
            answers = [];

            // for each available answer to this question...
            for (letter in questions[i].answers) {

                // ...add an html radio button
                answers.push(
                    '<div class="quizOption">' +
                    '<input type="radio" class="option" tabindex="0" id="question' + i + letter + '" name="question' + i + '" value="' + letter + '">' +
                    '<label class="optionLabel" for="question' + i + letter + '">' +
                    questions[i].answers[letter] +
                    '</label>' +
                    '</div>'
                );
            }

            // add this question and its answers to the output
            output.push(
                '<div class="quizSlide">' +
                '<div class="questionSec">' +
                '<h2 class= "quiz-heading" > '+ quiz_heading + '</h2>' +
                '<div class="question-text" role="heading" aria-level="3" id="question-' + i + '">' + questions[i].question + '</div>' +
                '</div>' +
                '<div class="answers" role="radiogroup" aria-labelledby="question-' + i + '" aria-describedby="PaginatorText">' + answers.join('') + '</div>' +
                '</div>'
            );
        }

        // finally combine our output list into one string of html and put it on the page
        quizContainer.innerHTML = output.join('');

        //Question text animation
        $(".quiz-heading,.question-text").css({
            "left": "800px"
        }).animate({
            "left": "0px"
        }, 500);
    }

    //Select answer function
    var selectAnswer = function () {
        $("input:radio[name=question" + currentQuestion + "]").off().change(function () {
            //If the checkbox is checked.
            if ($(this).is(':checked')) {
                                                            OnUpQuiz_SelectedAnswers[currentQuestion]= $(this).val();
                //Enable the continue or get results button(s).
                $('#continue_btn').attr("disabled", false);
                $('#getResults_btn').attr("disabled", false);
            } else {
                //If it is not checked, disable the button(s).
                $('#continue_btn').attr("disabled", true);
                $('#getResults_btn').attr("disabled", true);
            }
        });
    }

    //Store the total number of questions
    var totalQuestions = $('.quizSlide').length;

    //Set the current question to display to 1
    var currentQuestion = 0;

    //First question show
    var initQuiz = function () {
        $questions = $('.quizSlide');

        //Hide all the questions
        $questions.hide();

        //Progress bar's max and current value
        $("#quiz-progress").val(currentQuestion + 1);
        progressbar.max = totalQuestions;

        $($questions.get(currentQuestion)).show();
        questionCount = currentQuestion + 1;
        mobileNumberFmt = ("0" + questionCount).slice(-2);
        mobileTotalQstFmt = ("0" + totalQuestions).slice(-2);
        document.querySelector('.paginationTxt').innerHTML = 'Question ' + questionCount + ' of ' + totalQuestions;
        document.querySelector('.paginationTxtMobile').innerHTML = mobileNumberFmt + '/' + mobileTotalQstFmt;
    }

    if ($('.quiz-container')[0]) {
        initQuiz();
        selectAnswer();
    }

    var resetAll = function () {
        currentQuestion = 0;
        OnUpQuiz_SelectedAnswers = [];
        $('.answers input[type="radio"]').prop('checked', false);
        $('#getResults_btn').addClass("hidden");
        $('#continue_btn').removeClass("hidden");
        $('#continue_btn').attr("disabled", true);
        $('#goBack_btn').attr("disabled", true);
        initQuiz();
    }

    //attach a click listener to the HTML element with the id of 'continue'
    $('#continue_btn').click(function () {
        $('.question-text').removeClass("move");
        $($questions.get(currentQuestion)).hide();
        //increment the current question by one
        var cData = new Object();
        console.log(currentQuestion);
        cData.toolFlowInfo = "question: " + ( currentQuestion+1);
        cData.toolFlowName = $("#toolFlowName").val();
        marTech.trackAction(cData);
        currentQuestion = currentQuestion + 1;
                var cData = new Object();

//        cData.events = "event38";
//        cData.toolFlowName = $("#toolFlowName").val();
//        marTech.trackAction(cData);
        if (currentQuestion < totalQuestions) {
            if (!$("input:radio[name=question" + currentQuestion + "]").is(':checked')) {
                $('#continue_btn').attr("disabled", true);
            }
            $(".question-text").css({
                "left": "800px"
            }).animate({
                "left": "0px"
            }, 500);
            $($questions.get(currentQuestion)).show();
            selectAnswer();
            $('.quiz-container').attr("tabindex",-1).focus();
            questionCount = currentQuestion + 1;
            mobileNumberFmt = ("0" + questionCount).slice(-2);
            mobileTotalQstFmt = ("0" + totalQuestions).slice(-2);
            $("#quiz-progress").val(questionCount);
            document.querySelector('.paginationTxt').innerHTML = 'Question ' + questionCount + ' of ' + totalQuestions;
            document.querySelector('.paginationTxtMobile').innerHTML = mobileNumberFmt + '/' + mobileTotalQstFmt;
        }
        if (questionCount == totalQuestions) {
            if (!$("input:radio[name=question" + currentQuestion + "]").is(':checked')) {
                $('#getResults_btn').attr("disabled", true);
            }
            $('#continue_btn').addClass("hidden");
            $('#getResults_btn').removeClass("hidden");
            $('.quiz-container').attr("tabindex",-1).focus();
        }
        if (currentQuestion != 0) {
            $('#goBack_btn').attr("disabled", false);
        } else {
            $('#goBack_btn').attr("disabled", true);
        }
    });

    //Go Back button functionality
    $('#goBack_btn').click(function () {
        $('#continue_btn').removeClass("hidden");
        $('#getResults_btn').addClass("hidden");
        $('.question-text').addClass("move");
        $($questions.get(currentQuestion)).hide();
        //decrement the current question by one
        currentQuestion = currentQuestion - 1;
        questionCount = currentQuestion + 1;
        mobileNumberFmt = ("0" + questionCount).slice(-2);
        $("#quiz-progress").val(questionCount);
        if (currentQuestion < totalQuestions) {
			$('.quiz-container').attr("tabindex",-1).focus();
            if (!$("input:radio[name=question" + currentQuestion + "]").is(':checked')) {
                $('#continue_btn').attr("disabled", true);
            } else {
                $('#continue_btn').attr("disabled", false);
            }
        }
        if (currentQuestion == 0) {
            $(".move").css("marginLeft", -40).animate({
                marginLeft: 0
            }, '');
            $($questions.get(currentQuestion)).show();
            document.querySelector('.paginationTxt').innerHTML = 'Question ' + questionCount + ' of ' + totalQuestions;
            document.querySelector('.paginationTxtMobile').innerHTML = mobileNumberFmt + '/' + mobileTotalQstFmt;
            $('#goBack_btn').attr("disabled", true);
        } else {
            $(".move").css("marginLeft", -40).animate({
                marginLeft: 0
            }, '');
            $($questions.get(currentQuestion)).show();
            document.querySelector('.paginationTxt').innerHTML = 'Question ' + questionCount + ' of ' + totalQuestions;
            document.querySelector('.paginationTxtMobile').innerHTML = mobileNumberFmt + '/' + mobileTotalQstFmt;
            $('#goBack_btn').attr("disabled", false);
        }
    });

    // when user clicks get results, show results
    $('#getResults_btn').click(function () {
        $(".question-container").addClass("hidden");
        $(".result-container").removeClass("hidden");
        var XFIDToShow = OnUpQuiz_getXFID(OnUpQuiz_SelectedAnswers);
        $("#"+XFIDToShow).removeClass('hidden');
        var cData = new Object();

        cData.events = "event39";
        cData.toolFlowName = $("#toolFlowName").val();
        marTech.trackAction(cData);
    });

    $('.quizAgain_btn').click(function () {
        resetAll();
        $(".result-container, .responseSec").addClass("hidden");
        $(".question-container").removeClass("hidden");
        setTimeout(function (){
            quizContainerElement = document.querySelector(".quiz-container");
            quizContainerElement.scrollIntoView();
        }, 200);
    })

});

//focus trap for popup modal

function handleTrapEvent(lastFocusableElement, firstFocusableElement) {
    return function eventHandler(event) {
      const isTabPressed = event.key === 'Tab' || event.keyCode === 9;
  
      if (!isTabPressed) {
        return;
      }
  
      if (event.shiftKey) {
        if (document.activeElement === firstFocusableElement) {
          lastFocusableElement.focus();
          event.preventDefault();
        }
      } else if (document.activeElement === lastFocusableElement) {
        firstFocusableElement.focus();
        event.preventDefault();
      }
    };
  }
  
  function addTrapHandler(modal) {
    const focusableElements = 'button, [href], input, select, textarea, [tabindex]:not([tabindex="-1"])';
    const firstFocusableElement = modal.querySelector(focusableElements);
    const focusableContent = modal.querySelectorAll(focusableElements);
    const lastFocusableElement = focusableContent[focusableContent.length - 1];
  
    document.addEventListener('keydown', handleTrapEvent(lastFocusableElement, firstFocusableElement));
  }
  
  function initTrap(modals) {
    modals.forEach((modal) => {
      addTrapHandler(modal);
    });
  }
  
  document.addEventListener('DOMContentLoaded', () => {
    const modals = document.querySelectorAll('.modal');
    initTrap(modals);
  });
  

