///////////////////////////////////////////////////
///////////////////////////////////////////////////
// Set active page
///////////////////////////////////////////////////
///////////////////////////////////////////////////
// get all page link items to set the active state
//window.addEventListener('DOMContentLoaded',function(){
let pageLinkButtons = document.getElementsByClassName("navbar-secondary__link-item");
// get the menu toggle button to set the name at mobile
let toggleButton = document.getElementById("toggle-button");
let toggleButtonText = document.getElementById("toggle-button-text")
let testingForActivePageSecondaryNav = false
// loop through the buttons and add the active class to the button for the current page
if (toggleButton) {
  if (pageLinkButtons.length > 1) {
    for (let i = 0; i < pageLinkButtons.length; i++) {
      let pageLink = pageLinkButtons[i].getAttribute("href")
      if (window.location.pathname === pageLink) {
        pageLinkButtons[i].parentElement.classList.add("active");
        pageLinkButtons[i].parentElement.setAttribute("aria-current", "page");
        toggleButtonText.innerHTML = pageLinkButtons[i].innerText;
        testingForActivePageSecondaryNav = true
      }
    }
  }

  // setting backup menu text if no active page is found
  if (!testingForActivePageSecondaryNav) {
    toggleButtonText.innerHTML = "Menu";
  }
}

///////////////////////////////////////////////////
///////////////////////////////////////////////////
// Sticky Header
///////////////////////////////////////////////////
///////////////////////////////////////////////////
// get elements that will have classes added or removed
let secondaryNavbar = document.querySelector(".navbar-secondary__wrapper");
let mainHeader = document.querySelector("header");
let secondaryNavbarMobile = document.querySelector(".navbar-secondary__wrapper.display--mobile");
let secondaryNavbarCtaMobileButtonExperienceFragment = document.querySelector('.navbar-secondary__wrapper.display--mobile .navbar-secondary__cta-button-container div')
let secondaryNavbarCtaButton = document.querySelector(".navbar-secondary__cta-button-container");
let secondaryNavbarCtaButtonExperienceFragment = document.querySelector(".navbar-secondary__cta-button-container div");
if ((secondaryNavbar !== null || undefined) && (mainHeader !== null || undefined)) {
  let secondaryNavbarCtaButtonSticky = "false";
  if ((secondaryNavbarCtaButton !== null || undefined) && (secondaryNavbarCtaButton.hasAttribute("data-sticky-button"))) {
    secondaryNavbarCtaButtonSticky = secondaryNavbarCtaButton.getAttribute("data-sticky-button");
  }

  let mobilePhoneNumberContainer = document.querySelector(".navbar-secondary__wrapper.display--mobile > .navbar-secondary__container > .navbar-secondary__cta-wrapper > .navbar-secondary__cta-phone-container")
  let mobilePhoneNumberContainerLength
  if (mobilePhoneNumberContainer !== null) {
    mobilePhoneNumberContainerLength = mobilePhoneNumberContainer.innerText.trim().length
  }

  let mobileCtaContainer = document.querySelector(".navbar-secondary__wrapper.display--mobile > .navbar-secondary__container > .navbar-secondary__cta-wrapper")
  if (mobilePhoneNumberContainerLength === 0 && mobilePhoneNumberContainer !== null) {
    mobileCtaContainer.classList.add("reset-secondary-navbar")
  }

  if (mobileCtaContainer.childElementCount === 0) {
    mobileCtaContainer.classList.add("secondary-navbar--no-cta-present")
  }

  // configuration for the observer
  const secondarynavconfig = {
    root: null,
    threshold: [0, 0.1]
  };
  // create the observer
  let navObserver = new IntersectionObserver(function (entry) {
    addSecondaryNavBarClasses(entry[0].isIntersecting)
  }, secondarynavconfig);
  // observe the navbar
  navObserver.observe(mainHeader);

  function addSecondaryNavBarClasses(intersectionStatus) {
    // makes the secondary nav sticky if a user scrolls down far enough on the page
    const secondaryNavbarId = secondaryNavbar.parentElement.getAttribute("id");
    if(secondaryNavbarId.includes("-0")) {
      var secondaryNavbarId2 = secondaryNavbarId.slice(0,secondaryNavbarId.lastIndexOf('-'));
      var secondaryNavbarPlaceholder = document.querySelector("#" + secondaryNavbarId2 + "--placeholder");
    }
    else {
      var secondaryNavbarPlaceholder = document.querySelector("#" + secondaryNavbarId + "--placeholder");
      var secondaryNavbarHeight = document.querySelector(`#${secondaryNavbarId}`).offsetHeight;
    }
    // hides the cta button until the nav is sticky, if defined by the author
    if ((secondaryNavbarCtaButton !== null || undefined) && secondaryNavbarCtaButtonSticky === "true") {
      if (intersectionStatus === false) {
        secondaryNavbarCtaButtonExperienceFragment.classList.remove("hidden-cta");
        secondaryNavbarCtaMobileButtonExperienceFragment.classList.remove("hidden-cta");
      } else {
        secondaryNavbarCtaButtonExperienceFragment.classList.add("hidden-cta")
        secondaryNavbarCtaMobileButtonExperienceFragment.classList.add("hidden-cta");
      }
    }
  }
}

