let rateTables = document.querySelectorAll(".js-dynamic-rate-table");
rateTables.forEach((rateTable) => getAndSetTableData(rateTable));

///////////////////////////
// STEP 2: Fetch the Data
//////////////////////////
function getAndSetTableData(rateTableElement) {
  // locate data attributes to fetch the data and apply the correct templating
  let rateTableDataPath = rateTableElement.getAttribute("data-path");
  let rateTableDataAdapter = rateTableElement.getAttribute("data-adapter");

  // set loading animation
  loadingTable(rateTableElement);

  // fetch the data
  fetchWithTimeout(rateTableDataPath, {}, 10000)
    .then((response) => response.json())
    .then((json) => {
      // set the output of the createTable function as the HTML on the page
      rateTableElement.innerHTML = createTable(json, rateTableDataAdapter);
      rateTableElement.setAttribute("data-component-loaded", "true")
    })
    .catch((error) => {
      // set the output of the createTable function as the HTML on the page
      rateTableError(rateTableElement);
      rateTableElement.setAttribute("data-component-loaded", "false")
    });
}

///////////////////////////
// STEP 3: Create the Table
//////////////////////////

// creates the table based on the json that is returned
// also takes an argument for the type of table (e.g. term-table vs. product-table)
function createTable(jsonTableData, dataAdapter) {
  // variables for templating the table and mapping the json
  let productTierCols = ["Tier", "Rate", "APY"];
  let termTierCols = ["Term", "Tier", "Interest Rate", "APY"];
  let rateCols = ["Rate"];
  let apyCols = ["APY"];
  let tierFromCols = ["TierFrom"];
  let tierToCols = ["TierTo"];
  let termFromCols = ["TermFrom"];
  let termToCols = ["TermTo"];
  let termNameCols = ["TermName"];

  // stores transformed table data for the final template
  let headerRow;
  let rows;

  ///////////////////////////
  // product table variation
  //////////////////////////

  if (dataAdapter === "product-table") {
    // sorts the json response based on tierTo, in case the data retrieved is out of order
    let sortedData = jsonTableData.ProductInfo.sort(
      (higher, lower) => parseInt(higher.tierTo) - parseInt(lower.tierTo)
    );

    // map over columns, make headers, join into string
    headerRow = productTierCols.map((col) => {
        let colLowerCase = col.toLowerCase()
        return `<th scope="col" class="deposit-dynamic-rates-table__head-cell rate-table-${colLowerCase}">${col}</th>`
      })
      .join("");

    // map over rows, join into string
    rows = sortedData
      .map((row) => {
        let tierFromSpan = tierFromCols.map(
          (tierFromCol) =>
          `<span>${new Intl.NumberFormat("us-EN").format(
              row[tierFromCol]
            )}</span>`
        );

        let tierToSpan = tierToCols.map(
          (tierToCol) =>
          `<span>${new Intl.NumberFormat("us-EN").format(
              row[tierToCol]
            )}</span>`
        );

        let rateTd = rateCols.map(
          (rateCol) => `<td class="deposit-dynamic-rates-table__content-cell deposit-rate--rate-cell">${row[rateCol]}%</td>`
        );

        let apyTd = apyCols.map(
          (apyCol) => `<td class="deposit-dynamic-rates-table__content-cell deposit-rate--apy-cell">${row[apyCol]}%</td>`
        );

        let tierFromName = tierFromCols.map((tierFromCol) => row[tierFromCol].toLowerCase());
        let tierToName = tierToCols.map((tierToCol) => row[tierToCol].toLowerCase());
        let trClassWithSpaces = `deposit-rate--${tierFromName}-${tierToName}`
        let trClassNoSpaces = trClassWithSpaces
        return `<tr class="deposit-dynamic-rates-table__row ${trClassNoSpaces}"><td class="deposit-dynamic-rates-table__content-cell deposit-rate--tier-cell">$${tierFromSpan}-$${tierToSpan}</td>${rateTd}${apyTd}</tr>`;
      })
      .join("");
  }

  ///////////////////////////
  // term table variation
  //////////////////////////

  if (dataAdapter === "term-table") {
    // removes filler days from the json data—filler days have a termTo value of 99999
    let fillerDaysRemoved = jsonTableData.ProductInfo.filter(
      (jsonData) => parseInt(jsonData.TermTo) !== 99999
    );

    // sorts the json response based on termTo, in case the data retrieved is out of order
    let sortedData = fillerDaysRemoved.sort(
      (higher, lower) => parseInt(higher.TermTo) - parseInt(lower.TermTo)
    );

    // declaring variables to be used for checking if a title should be hidden in the table
    let sortedDataComparison;
    let sortedDataNext;

    // loop through the content and add a value for hiding the title if it is a duplicate
    for (let i = 0; i < sortedData.length; i++) {
      // set the current term name
      sortedDataNext = sortedData[i].TermName;

      // if the title is the same as the previous title in the list, add a sr-only class as a value, if not, leave the value empty
      if (sortedDataNext === sortedDataComparison) {
        sortedData[i].hideTitle = "sr-only";
      } else {
        sortedData[i].hideTitle = "";
      }

      // set the current term name to be checked against the next term name
      sortedDataComparison = sortedData[i].TermName;
    }

    // map over columns, make headers, join into string
    headerRow = termTierCols.map((col) => {
        let colLowerCase = col.toLowerCase()
        return `<th scope="col" class="deposit-dynamic-rates-table__head-cell rate-table-header-${colLowerCase}">${col}</th>`
      })
      .join("");

    // map over rows, join into string
    rows = sortedData
      .map((row) => {
        // add in the hideTitle value as a class name on the span to hide the title, if needed
        // also set the termName to lowercase and so it can be properly capitalized by css later
        let termTd = termNameCols.map(
          (termNameCol) =>
          `<th scope="row" class="deposit-dynamic-rates-table__content-cell deposit-rate--term-cell"> <span class="${
              row["hideTitle"]
            }">${row[termNameCol].toLowerCase()}</span></th>`
        );

        let tierFromSpan = tierFromCols.map(
          (tierFromCol) =>
          `<span>${new Intl.NumberFormat("us-EN").format(
              row[tierFromCol]
            )}</span>`
        );

        let tierToSpan = tierToCols.map(
          (tierToCol) =>
          `<span>${new Intl.NumberFormat("us-EN").format(
              row[tierToCol]
            )}</span>`
        );

        let rateTd = rateCols.map(
          (rateCol) => `<td class="deposit-dynamic-rates-table__content-cell deposit-rate--rate-cell">${row[rateCol]}%</td>`
        );

        let apyTd = apyCols.map(
          (apyCol) => `<td class="deposit-dynamic-rates-table__content-cell deposit-rate--apy-cell">${row[apyCol]}%</td>`
        );

        let termName = termNameCols.map((termNameCol) => row[termNameCol].toLowerCase());
        let tierFromName = tierFromCols.map((tierFromCol) => row[tierFromCol].toLowerCase());
        let tierToName = tierToCols.map((tierToCol) => row[tierToCol].toLowerCase());
        let trClassWithSpaces = `deposit-rate--${termName}-${tierFromName}-${tierToName}`
        let trClassNoSpaces = trClassWithSpaces.replace(" ", "-")

        return `<tr class="deposit-dynamic-rates-table__row ${trClassNoSpaces}">${termTd}<td class="deposit-dynamic-rates-table__content-cell deposit-rate--tier-cell">$${tierFromSpan}-$${tierToSpan}</td>${rateTd}${apyTd}</tr>`;
      })
      .join("");
  }

  ///////////////////////////
  // build the final table
  //////////////////////////

  let table = `
    <div class="deposit-rates-scrolling-table deposit-rates-table-dark deposit-rates-scroller">
        <table class="deposit-dynamic-rates-table">
            <thead class="deposit-dynamic-rates-table__head">
                <tr>${headerRow}</tr>
            </thead>
            <tbody class="deposit-dynamic-rates-table__content"> 
                ${rows}
            </tbody>
        </table>
    </div>`;

  return table;
}

