function setDepositRateTablePath(data) {
  // get the ID for the wrapper div to target the correct elements (if there are multiple state selector components on a page)
  const parentContainerId = data.parentElement.parentElement.parentElement.getAttribute("id")

  // get the select element and the selected value attribute and inner text
  const formSelectionElement = document.querySelector(`div#${parentContainerId} select`)
  const formSelection = formSelectionElement.options[formSelectionElement.selectedIndex].value
  const formSelectionName = formSelectionElement.options[formSelectionElement.selectedIndex].innerText.trim()

  // get the error container
  const errorContainer = document.querySelector(`div#${parentContainerId} .state-selector-error-wrapper`)

  // get the rate table container, rate table intros, and aria-live span
  const rateTables = document.querySelectorAll(`div#${parentContainerId} .js-state-selector-table > .js-dynamic-rate-table-postpone-render`)
  const accessbilityUpdateSpan = document.querySelector(`div#${parentContainerId} .js-state-selector-table > span.js-state-selector-accessbility-update-message`)
  const rateTableIntros = document.querySelectorAll(`div#${parentContainerId} .js-state-selector-table > .js-dynamic-table-intro`)

  // set the error on the page and return if the value is empty
  if (formSelection.length === 0) {
    addStateSelectorErrorMessage(errorContainer, formSelectionElement, rateTables, rateTableIntros);
    return;
  }

  // remove the error message
  if (formSelectionElement.getAttribute("data-error-open") === "true") {
    removeStateSelectorErrorMessage(errorContainer, formSelectionElement)
  }

  rateTables.forEach((rateTable) => {
    // get and set the new data-path attribute for the api call
    let apiUrl = rateTable.getAttribute("data-path").split("?")
    let existingQueryParms = apiUrl[1].split("&")
    let productCode = existingQueryParms[1]
    let newApiUrl = `${apiUrl[0]}?${formSelection}&${productCode}`
    rateTable.setAttribute("data-path", newApiUrl)

    // fade in the table
    fadeInStateSelector(rateTable)

    // call the api and build the table
    getAndSetTableData(rateTable)
  });

  // remove hidden class from rate table intros
  rateTableIntros.forEach((rateTableIntro) => rateTableIntro.classList.remove("hidden"))

  // set new text in the aria-live span
  accessbilityUpdateSpan.innerText = `Rate table updated for ${formSelectionName}`
}

