const DYNAMIC_RATES_TIMEOUT_LENGTH_v3 = 100;

// global timeout map; quick n dirty
const dynamicRatesTimeouts_v3 = new WeakMap();

// if the user actively dismisses a tooltip, save that setting
// and do not show the tooltip again
const dynamicRatesDismissal_v3 = new WeakMap();
// attach all event listeners to control the tooltip
 window.initDynamicRatesTooltip = function(tooltipContainer) {
    const trigger = tooltipContainer.classList.contains('mortgage-rate-tooltip-trigger') ? tooltipContainer : tooltipContainer.querySelector('.mortgage-rate-tooltip-trigger');
    const tooltip = tooltipContainer.querySelector('.mortgage-rate-tooltip');
    // show tooltip on hover and focus
    tooltipContainer.addEventListener('mouseenter', () => {
        showTooltip(tooltip);
    });
    trigger.addEventListener('focus', () => {
        showTooltip(tooltip);
    });
    // hide tooltip on mouse out and blur
    // use timeout on mouse leave
    tooltipContainer.addEventListener('mouseleave', () => {
        timeoutTooltip(tooltip);
    });
    trigger.addEventListener('blur', () => {
        hideTooltip(tooltip);
    });

    //Show tooltip on click, when opens in touch devices
    var ua = navigator.userAgent;
    function is_touch_device() { 
        try {  
            document.createEvent("TouchEvent");  
            return true;  
        } catch (e) {  
            return false;  
        }  
    }

    if ((is_touch_device()) || ua.match(/(iPhone|iPod|iPad)/) || ua.match(/BlackBerry/) || ua.match(/Android/)) {
        tooltipContainer.addEventListener('touchstart', () => {
            showTooltip(tooltip);
        });
        trigger.addEventListener('touchend', () => {
            hideTooltip(tooltip);
        });
    }

    // hide the tooltip on escape key press
    trigger.addEventListener('keydown', (event) => {
        if (event.key === 'Escape') {
            hideTooltip(tooltip);
            // save dismissal
            dynamicRatesDismissal_v3.set(tooltip, true);
        }
    });

    tooltip.style.display = 'none';
}

function showTooltip(tooltip) {
    // do not show if tooltip has been dismissed
    if (dynamicRatesDismissal_v3.has(tooltip)) {
        return false;
    }
    tooltip.style.display = 'block';
    tooltip.removeAttribute('aria-hidden');
    // if a hide timeout exists for this tooltip, clear it
    if (dynamicRatesTimeouts_v3.has(tooltip)) {
        window.clearTimeout(dynamicRatesTimeouts_v3.get(tooltip));
    }
}

function hideTooltip(tooltip) {
    tooltip.style.display = 'none';
    tooltip.setAttribute('aria-hidden', 'true');
}

function timeoutTooltip(tooltip) {
    // hide the tooltip after a set amount of time
    const timeoutId = window.setTimeout(() => {
        hideTooltip(tooltip);
    }, DYNAMIC_RATES_TIMEOUT_LENGTH_v3);
    // store the timeout so it can be cleared
    dynamicRatesTimeouts_v3.set(tooltip, timeoutId);
}
// initiate dynamicRatesTooltips
setTimeout(function () {
    const dynamicRatesTooltips_v3 = document.querySelectorAll('.mortgage-rate-tooltip-wrapper');
    dynamicRatesTooltips_v3.forEach((tooltip) => {
        initDynamicRatesTooltip(tooltip);
    });
}, 2000);
