$(document).ready(async () => {
    var $slideContainer = $('.slide-container');
    var $window = $(window);
    var gsWindowWidth = $window.width();
    var slideContainerList = $('.slide-container-list');
    var slideContainerItem = $('.slide-container-item');
    var sliderInstance = document.getElementsByClassName('splide');
    if (!$slideContainer.length) return;
    try {
        await LibLoader.get({
            uri: '/etc/clientlibs/truist-global/clientlibs/js/splide.js', verifier: () => !!Splide
        }, '/etc/clientlibs/truist-global/clientlibs/css/splide.css');
    }
    catch (err) {
        console.error(err);
    }
    function setSlideContainerHeight() {
        const scrollerContainer = document.querySelector(".slide-container-scroller");
        if (!scrollerContainer) return;
        const allSliderCards = document.querySelectorAll(".slider-card");
        const mainSliderContainer = document.querySelector(".slide-container");
        const cardSizes = [];

        allSliderCards.forEach(sliderCard => cardSizes.push(sliderCard.offsetHeight));
        const sliderCardMaxHeight = Math.max(...cardSizes) + 84;

        mainSliderContainer.style.height = `${sliderCardMaxHeight}px`;
    }
    function visibleCardFocus() {
        $('.slide-container-item.is-visible').attr({
            "aria-hidden": "false",
        }).find("a").attr({
            tabindex: "0",
            "aria-hidden": "false",
        });
        $('.slide-container-item:not(".is-visible")').attr({
            "aria-hidden": "true",
        }).find("a").attr({
            tabindex: "-1",
            "aria-hidden": "true",
        });
    }
    function keyBoardControls() {
        $(sliderInstance).keydown(function (e) {
            var arrow = {left: 37, right: 39};
            switch (e.which) {
                case arrow.left:
                    $('.slide-container.active-slider .slide-container-item.is-active').removeClass('is-active').prev().focus().addClass('is-active');
                    break;
                case arrow.right:
                    $('.slide-container.active-slider .slide-container-item.is-active').removeClass('is-active').next().focus().addClass('is-active');
                    break;
                default: return;
            }
            e.preventDefault();
            visibleCardFocus();
        });
    };
    function buildSlideContainer() {
        for (var i = 0, len = sliderInstance.length; i < len; i++) {
            if (gsWindowWidth < 1025 && $slideContainer.length > 0) {
                new Splide(sliderInstance[i], {
                    type: "slide",
                    rewind: false,
                    speed: 300,
                    perMove: 1,
                    arrows: true,
                    classes: {
                        prev: "slide-container-before",
                        next: "slide-container-after",
                    },
                    padding: {
                        left: 20,
                        right: 20,
                    },
                    pagination: false,
                    autoplay: false,
                    hasProgress: false,
                    easing: "ease-in-out",
                    accessibility: true,
                    keyboard: true,
                    drag: true,
                    dragAngleThreshold: 100,
                    swipeDistanceThreshold: 0.5,
                    flickPower: 500,
                    flickMaxPages: 25,
                    direction: 'ltr',
                    cover: false,
                    trimSpace: true,
                    fixedWidth: "315px",
                    width: "auto",
                    minHeight: "180px",
                    resetProgress: false,
                    focus: 0,
                    start: 0,
                    slideFocus: false,
                    updateOnMove: true,
                }).mount();

            } else if (gsWindowWidth >= 1025 && $slideContainer.length > 0) {
                var sliderEl = new Splide(sliderInstance[i], {
                    type: "slide",
                    rewind: false,
                    speed: 300,
                    perMove: 1,
                    arrows: true,
                    classes: {
                        prev: "slide-container-before",
                        next: "slide-container-after",
                    },
                    padding: {
                        left: 120,
                        right: 40,
                    },
                    pagination: false,
                    autoplay: false,
                    hasProgress: false,
                    easing: "ease-in-out",
                    accessibility: true,
                    keyboard: true,
                    drag: false,
                    dragAngleThreshold: 100,
                    swipeDistanceThreshold: 0.5,
                    flickPower: 500,
                    flickMaxPages: 25,
                    direction: 'ltr',
                    cover: false,
                    trimSpace: true,
                    fixedWidth: "315px",
                    width: "auto",
                    minHeight: "180px",
                    resetProgress: false,
                    focus: 0,
                    start: 0,
                    slideFocus: false,
                    updateOnMove: true,
                }).mount();
                sliderEl.on('moved', function () {
                    $('.slide-container-item.is-visible').find('a').attr({
                         tabindex: "0",
                         "aria-hidden": "false",
                    });
                    setTimeout(function () {
                        $('.slide-container-item:not(.is-visible)').find('a').attr({
                            tabindex: '-1', 
                            "aria-hidden": "true",
                        })}, 500);
                      if ($(slideContainerItem[2]).hasClass('is-active')) {
                        // $('.splide.slide-container-scroller .splide__arrow.slide-container-after').attr('disabled', 'disabled');
                        $('.splide.slide-container-scroller .splide__arrow.slide-container-before').focus();
                      } else if (!$(slideContainerItem[2]).hasClass('is-active')) {
                        // $('.splide.slide-container-scroller.splide__arrow.slide-container-after').removeAttr('disabled');
                      }
                  });

                  $(slideContainerItem).find('a').attr('tabindex', '-1');
                  setTimeout(function () {
                    $('.slide-container-item.is-visible').find('a').attr('tabindex', '0');
                  }, 500);
            }
            $(slideContainerList).css({
                'animation': 'slidein-cards 1.5s ease-in-out forwards'
            });
            // $('.slide-container .slide-container-before').removeAttr('disabled');
        }
        $.each(sliderInstance, function () {
            var slideContainerMove;
            if (slideContainerItem.length >= 4) {
                slideContainerMove = ((slideContainerItem.width() + (40 * slideContainerItem.length)) * slideContainerItem.length) + 120;
            } else {
                slideContainerMove = 1500
            }
            $(slideContainerList).css({
                'visibility': 'visible',
                'left': slideContainerMove + 'px'
            });
            if ($(this).find(slideContainerItem).length <= 4) {
                $(this).find(slideContainerItem).removeClass("closeToLast firstLoser nearLast lastGuy").addClass("is-visible");
                $(this).find(".leader").attr({
                    // tabindex: "0",
                    "aria-hidden": "false",
                }).find("a").attr({
                    tabindex: "0",
                    "aria-hidden": "false",
                });
                $(this).find(".splide__arrows").hide();
            } else if ($(this).find(slideContainerItem).length <= 3) {
                $(this).find('.splide__track').css({
                    'padding-right': '0px',
                    'padding-left': '0px'
                });
                $(this).find('.splide__list.slide-container-list').css({
                    'transform': 'translateX(-80px)'
                });
            }
        });
    }
    function initSlideContainer() {
        buildSlideContainer();
        keyBoardControls();
        visibleCardFocus();
    }
    $(window).on('load', initSlideContainer);
    $(window).resize(setSlideContainerHeight);
});
$(document).ready(function () {
    const StaticCards = $('.truist-staticcard');
    if (StaticCards.length === 0) {
        return;
    } else {
        function staticCardDynamicProperties() {
            var intStaticCardCount = 0;
            $('.truist-global-staticcard-card-cta-button').parent().addClass('truist-global-staticcard-button-bottom');

            $('.truist-global-staticcard-container').each(function (indexParent) {
                $(this).find('.truist-global-staticcard-eyebrow').parent().addClass('truist-global-staticcard-eyebrow-margin-bottom');
                $(this).find('.truist-global-staticcard-eyebrow').parent().next().children('.truist-global-staticcard-cardtitle').addClass('truist-global-staticcard-eyebrow-font-300');

                intStaticCardCount = $(this).children().length;
                if (intStaticCardCount <= 3) {
                    if (intStaticCardCount === 3) {
                        $(this).addClass('truist-global-staticcard-container-gap-twenty');
                        $(this).children().addClass('truist-global-staticcard-maxwidth-thirty-percent');
                    } else {
                        $(this).addClass('truist-global-staticcard-container-gap-thirty');
                    }
                } else {
                    $(this).addClass('truist-global-staticcard-container-gap-twenty');
                }
                if (!($(this).find('.truist-global-staticcard-row:first-child').children().hasClass('truist-global-staticcard-img-top'))) {
                    $(this).children().addClass('truist-global-staticcard-container-padding-top');
                }

                intStaticCardCount = $(this).find('.truist-global-staticcard-column-transparent').length;
                if (intStaticCardCount > 1) {
                    $(this).children().addClass('truist-global-staticcard-column-transparent-border');
                } else {
                    $(this).children().removeClass('truist-global-staticcard-column-transparent-border');
                }
            });
        }

        staticCardDynamicProperties();
    }
});
