(() => {
   const CMP_ACC_PANEL = $(".accordion-panel");
   if (CMP_ACC_PANEL.length === 0) {
      return;
   } else {
      const CMP_ACC_PANELS = document.querySelectorAll('.accordion-panel'),
         WINDOW = window,
         // Function to change panel DOM location from Mobile <===> Tablet
         shiftPanels = () => {
            let panel = document.querySelectorAll('.accordion-panel .panel'),
               tiles = document.querySelectorAll(".accordion-panel .tile"),
               activeDescription = document.querySelector('.accordion-panel .show > .card-body'),
               container = document.querySelector('.accordion-panel');
            if ((WINDOW.innerWidth >= 768 && panel.length === 1) ||
               (WINDOW.innerWidth < 768 && panel.length > 1)) {
               return;
               //If Mobile ===> Tablet
            } else if (WINDOW.innerWidth >= 768 && panel.length === 0) {
               $(tiles).wrapAll('<div class="col-sm-12 col-md-5 panel"/>');
               $(tiles).parent().detach();
               $(container).append($(tiles).parent());
               //If Tablet ===> Mobile
            } else if (WINDOW.innerWidth < 768 && panel.length === 1) {
               $(panel).detach();
               $(activeDescription).append(panel);
               $(CMP_ACC_PANELS).find(tiles).unwrap();
            }
         },
         // Run Accordion-Panel Master Function
         runAccordionPanel = () => {
            // Set the unique identifier for the component instance
            for (n = 0; n < CMP_ACC_PANELS.length; n++) {
               CMP_ACC_PANELS[n].setAttribute("id", "accordion-panel-" + n);
            }
            CMP_ACC_PANELS.forEach(accPanel => {
               // Set the unique vars for the component instance
               let accPanel_ID = accPanel.getAttribute("id"),
                  Accs = document.querySelectorAll(`#${accPanel_ID} .accordion-element`),
                  Acc_Headings = document.querySelectorAll(`#${accPanel_ID} .card-header`),
                  Acc_Buttons = document.querySelectorAll(`#${accPanel_ID} .acc-button`),
                  Acc_Descriptions = document.querySelectorAll(`#${accPanel_ID} .acc-description`),
                  Acc_DescriptionsText = document.querySelectorAll(`#${accPanel_ID} .acc-description p:nth-child(2)`),
                  Acc_Tiles = document.querySelectorAll(`#${accPanel_ID} .tile`);

                  // Set id for each accordion item
               Accs.forEach((accordion, i) => {
                  accordion.setAttribute("id", `${accPanel_ID}-accordion-parsys-` + i);
                  if ($(accordion).closest('.row').hasClass('control-left')) {
                     $(accordion).closest('.col-md-7').removeClass('order-2');
                     $(accordion).closest('.col-md-5').removeClass('order-1');
                  } else if ($(accordion).closest('.row').hasClass('control-right')) {
                     $(accordion).closest('.col-md-7').addClass('order-2');
                     $(accordion).closest('.col-md-5').addClass('order-1');
                  }
               });

               // Set id for each accordion control heading
               Acc_Headings.forEach((heading, i) => {
                  heading.setAttribute("id", `#${accPanel_ID}-accordion-heading-` + i);
                  let expanded = $(heading).closest(Accs).hasClass('active'),
                     targetButton = $('.accordion-element.active').find('button');
                  if (expanded) {
                     $(targetButton).attr('aria-expanded', true);
                  }
                  heading.setAttribute("aria-describedby", `${accPanel_ID}-accordion-description-text-` + i);
               });

               // Set id aria- and data- for each accordion description
               Acc_Descriptions.forEach((description, i) => {
                  description.removeAttribute('aria-labelledby');
                  description.setAttribute("id", `${accPanel_ID}-accordion-description-` + i);
                  description.setAttribute("data-parent", "#" + accPanel_ID);
               });

                // Set id aria- and data- for each accordion description
                Acc_DescriptionsText.forEach((textBlock, i) => {
                  textBlock.setAttribute("id", `${accPanel_ID}-accordion-description-text-` + i);
                  textBlock.setAttribute("aria-live", "polite");
               });

               // Set id data- for each accordion tile
               // data-target-panel is used to target the tile images - matches trigger data-target-control value
               Acc_Tiles.forEach((tile, i) => {
                  tile.setAttribute("id", `${accPanel_ID}-accordion-tile-` + i);
                  tile.setAttribute("data-target-panel", `${accPanel_ID}-hit-` + i);
                  // $(tile).find('img').attr('describedby', `#${accPanel_ID}-accordion-heading-` + i);
                  // tile.setAttribute("aria-live", "polite");
                  shiftPanels();
               });

               // Set aria- and data- for each accordion description
               // data-target-control is used to change the tile images - matches tile data-target-panel value
               Acc_Buttons.forEach((button, i) => {
                  button.setAttribute("data-target", `#${accPanel_ID}-accordion-description-` + i);
                  button.setAttribute("aria-controls", `${accPanel_ID}-accordion-description-` + i);
                  button.setAttribute("data-target-control", `${accPanel_ID}-hit-` + i);

                  // Button click event
                  button.addEventListener("click", (e) => {
                     let btnExpanded = document.querySelector('button[aria-expanded="true"]')
                     if (button === btnExpanded) {
                        // Stop the div build duplication on click
                        e.stopPropagation();
                     } else if (button !== btnExpanded) {
                        $('.card').removeClass('active');
                        button.setAttribute('aria-expanded', false)
                        $(button).closest('.card').addClass('active');
                        //Find the matching image tile on trigger interaction
                        if (WINDOW.innerWidth >= 768) {
                           let targetFinder = button.getAttribute('data-target-control'),
                              impactSite = document.querySelector('.tile.show'),
                              impactTarget = impactSite.getAttribute('data-target-panel');
                           if (targetFinder === impactTarget) {
                              return;
                           } else if (targetFinder !== impactTarget) {
                              let activeTile = document.querySelector("[data-target-panel='" + targetFinder + "']");
                              impactSite.classList.remove('show')
                              activeTile.classList.add('show');
                           }
                        } else if (WINDOW.innerWidth < 768) {
                           // In mobile we have to manipulate the DOM
                           let targetFinder = button.getAttribute('data-target-control'),
                              impactSite = document.querySelector('.tile.show'),
                              impactTarget = impactSite.getAttribute('data-target-panel');
                           if (targetFinder === impactTarget) {
                              return;
                           } else if (targetFinder !== impactTarget) {
                              let activeTile = document.querySelector("[data-target-panel='" + targetFinder + "']");
                              impactSite.classList.remove('show');
                              // Gotta wait for the DOM to manipulate
                              setTimeout(() => {
                                 $('.card.active').find('.collapse.show').find('.card-body').append(Acc_Tiles);
                              }, 400);
                              activeTile.classList.add('show');
                           }
                        }
                     }
                  });
               });
            });
         };
      // Run that
      $(window).on('load resize', runAccordionPanel);
   }
})();
