(() => {
    const $itemSlider = $(".item-slider");

    if ($itemSlider.length) {
        document.addEventListener("DOMContentLoaded", async () => {
            try {
                await LibLoader.get({
                    uri: '/etc/clientlibs/truist-global/clientlibs/js/splide.js', verifier: () => !!Splide
                }, '/etc/clientlibs/truist-global/clientlibs/css/splide.css');
            } catch (err) {
                console.error(err);
            }

            const itemSliders = document.querySelectorAll(".item-slider");

            for (i = 0; i < itemSliders.length; i++) {
                const fadeOutLoader = () => {
                    $('.item-slider-section .loading-container').fadeOut('slow');
                    $(itemSliders[i]).fadeIn('slow');
                };

                const tabControl = () => {
                    $($itemSlider).find('.item-slider-card-link').attr({
                        "aria-hidden": "true",
                        tabindex: "-1"
                    });
                    if ($($itemSlider).find('.splide__slide').hasClass("is-visible") || $($itemSlider).find('.splide__slide').attr('aria-hidden' === false)) {
                        let $this = $($itemSlider).find('.splide__slide[aria-hidden="false"]')
                        $($this).find('.item-slider-card-link').attr({
                            "aria-hidden": "false",
                            tabindex: "0"
                        });
                    } else if (!$($itemSlider).find('.splide__slide').hasClass("is-visible")) {
                        let $this = $($itemSlider).find('.splide__slide:not(".is-visible")');
                        $($this).find('.item-slider-card-link').attr({
                            "aria-hidden": "true",
                            tabindex: "-1"
                        });
                    }
                };

                const keyBoardControls = () => {
                    $($itemSlider).keydown(function (e) {
                        var arrow = {left: 37, right: 39};
                        switch (e.which) {
                                 case arrow.left:
                                $(this).find('.splide__slide.is-active a').blur().parent().prev().addClass('is-active').find('a').focus()
                                break;
                            case arrow.right:
                                $(this).find('.splide__slide.is-active a').blur().parent().next().addClass('focused').find('a').focus()
                                break;
                            default: return;
                        }
                    });
                };


 				   const arrowReadOutADA = (direction) => {
                    $('.item-slider-' + direction).click(function(){
                        $('.splide__slide.is-active').attr("aria-live", "polite");
                        setTimeout(function(){
                        $('.splide__slide.is-active').removeAttr("aria-live");
                        }, 500);
                    });
                 };

                const getNativeItemIndex = (slider) => {
                    var items = $(slider).find(".splide__slide");
                    for (var j = 0; j < items.length; j++) {
                        var sliderItem = items[j];
                        if ('itemnative' in sliderItem.dataset) {
                            return j;
                        }
                    }
                    return 0;
                }

                var startIndex = getNativeItemIndex(itemSliders[i]);
                new Splide(itemSliders[i], {
                    type: "slide",
                    rewind: false,
                    speed: 300,
                    perMove: 1,
                    perPage: 1,
                    arrows: true,
                    gap: 8,
                    classes: {
                        prev: "item-slider-before",
                        next: "item-slider-after",
                    },
                    pagination: false,
                    autoplay: false,
                    hasProgress: false,
                    easing: "ease-in-out",
                    accessibility: true,
                    keyboard: true,
                    drag: true,
                    dragAngleThreshold: 100,
                    swipeDistanceThreshold: 0.5,
                    flickPower: 100,
                    flickMaxPages: 0,
                    direction: "ltr",
                    cover: false,
                    trimSpace: true,
                    fixedWidth: 155,
                    autoHeight: true,
                    resetProgress: false,
                    start: startIndex,
                    slideFocus: false,
                    updateOnMove: true
                }).mount().on('moved', tabControl);
                tabControl();
                keyBoardControls();
                fadeOutLoader();
				arrowReadOutADA('before');
				arrowReadOutADA('after');
            }
        });
    }
})();
