// Life Force interactive calculator functionality
$( () => $( '#lf-calculator' ).each( ( i, elem ) => {
  const $CMP = $( elem );
  const CMP_DATA = $CMP.data();
  if ( !CMP_DATA.jsonUrl ) { return; }  // bail out if url is blank, since .getJSON() call below with blank url would request the page again!

  let arrData = [];
  let lf_responseCont = "";
  let item, key;

  // Fill the first dropdown with data.
  $.getJSON( CMP_DATA.jsonUrl, data => {
      let medicalPlanOptions = [];

      $.each(data, function (index, value) {
          medicalPlanOptions.push(value.Medical_plan);
          arrData = data;
      });

      // Remove duplicates. We want unique Medical Plans.
      medicalPlanOptions = Array.from(new Set(medicalPlanOptions));

      // Fill the first dropdown with unique Medical Plans.
      $.each(medicalPlanOptions, function (index, value) {
          $('#Medical_plan').append('<option value="' + value + '">' + value + '</option>');
      });

      /* Initial Load of Coverage Level options */
      generate_coverageLvlOpts();

      /* Initial Load of Salary Range options */
      generate_salaryRangOpts();
  } );

  $('#Medical_plan').change(function () {
      $('#Medical_plan').parent().removeClass('lf-calculator-floating-select-error');
      $(this).parent().next('.mandatoryFld_error').addClass('hidden');

      $('#Coverage_level').attr('value', "");
      $('#Salary_range').attr('value', "");
      $('#Salary_range').empty()
          .append('<option value="" style=" display:none;" aria-hidden="true"></option>');
      generate_coverageLvlOpts();

  });

  function generate_coverageLvlOpts() {
      var Medical_plan = $('#Medical_plan').attr('value').trim();

      var coverageLevelOptions = [];

      var filterData = arrData.filter(function (value) {
          return Medical_plan === Medical_plan;
      });
      //console.log(filterData);
      $.each(filterData, function (index, value) {
          coverageLevelOptions.push(value.Coverage_level);
      });

      coverageLevelOptions = Array.from(new Set(coverageLevelOptions));

      $('#Coverage_level')
          .empty()
          .append('<option value="" style=" display:none;" aria-hidden="true"></option>');

      $.each(coverageLevelOptions, function (index, value) {
          // Now, fill the second dropdown list with coverage level.
          $('#Coverage_level').append('<option value="' + value + '">' + value + '</option>');
      });
  }

  $('#Coverage_level').change(function () {
      $('#Coverage_level').parent().removeClass('lf-calculator-floating-select-error');
      $(this).parent().next('.mandatoryFld_error').addClass('hidden');

      $('#Salary_range').attr('value', "");
      generate_salaryRangOpts();
  });

  function generate_salaryRangOpts() {
      let Coverage_level = $('#Coverage_level').attr('value').trim();
      let salaryRangeOptions = [];

      let filterData2 = arrData.filter(function (value) {
          return Coverage_level === Coverage_level;
      });

      // Reset Coverage Level drop-down value

      $.each(filterData2, function (index, value) {
          salaryRangeOptions.push(value.Salary_range);
      });

      salaryRangeOptions = Array.from(new Set(salaryRangeOptions));

      $('#Salary_range')
          .empty()
          .append('<option value="" style=" display:none;" aria-hidden="true"></option>');

      $.each(salaryRangeOptions, function (index, value) {
          // Now, fill the third dropdown list with salary range.
          $('#Salary_range').append('<option value="' + value + '">' + value + '</option>');
      });
  }

  $('#Salary_range').change(function () {
      $('#Salary_range').parent().removeClass('lf-calculator-floating-select-error');
      $(this).parent().next('.mandatoryFld_error').addClass('hidden');
  });

  //Manipulate filtered results from JSON
  function fetchResultItem(medicalPlan, coverageLvl, salaryRng) {
      for (item of arrData) {

          if (item["Medical_plan"] == medicalPlan && item["Coverage_level"] == coverageLvl && item["Salary_range"] == salaryRng) {
              //Render the results based on the filtered array object
              let filteredArr = [];
              lf_responseCont = "";

              for (key in item) {
                  filteredArr.push(key);
              }

              let FilteredPhaseLen = (parseInt(filteredArr.length) - 3) / 3;
              lf_responseCont = '<h2 class="sr-only">Life force calculator results, ' + FilteredPhaseLen + ' resources</h2>';
              for (var i = 0; i < FilteredPhaseLen; i++) {
                  lf_responseCont += '<div class="lf-resultSec">';
                  lf_responseCont += '<div class="lt-resultHeadSec">';
                  if ( CMP_DATA.phaseLink ) {
                      lf_responseCont += '<h3 class="lt-resultHeadTxt">Phase ' + (i + 2) + '</h3> <a href="#" class="lt-resultHeadLnkTxt lf-seeDetailModal-phase' + (i + 2) + '" data-toggle="modal">' + CMP_DATA.phaseLink + '</a>';
                      lf_responseCont += '<span class="sr-only">' + CMP_DATA.phaseSrContent + '</span>';
                  } else {
                      lf_responseCont += '<h3 class="lt-resultHeadTxt">Phase ' + (i + 2) + '</h3>';
                  }
                  lf_responseCont += '</div>';
                  lf_responseCont += '<div class="lf-resultPayOptSec">';
                  lf_responseCont += '<div class="lf-resultPayOpt"><span class="lf-resultPayOptLbl">Semi-monthly: </span>';
                  lf_responseCont += '<span class="lf-resultPayOptVal">' + item["Semi_monthly_phase_" + (i + 2)] + '</span></div>';
                  lf_responseCont += '<div class="lf-resultPayOpt"><span class="lf-resultPayOptLbl">Monthly: </span>';
                  lf_responseCont += '<span class="lf-resultPayOptVal">' + item["Monthly_phase_" + (i + 2)] + '</span></div>';
                  lf_responseCont += '<div class="lf-resultPayOpt"><span class="lf-resultPayOptLbl">Annual: </span>';
                  lf_responseCont += '<span class="lf-resultPayOptVal">' + item["Annual_phase_" + (i + 2)] + '</span></div>';
                  lf_responseCont += '</div>';
                  lf_responseCont += '</div>';
              }
          } else {
              $('#lf-responseSec').empty();
          }

      }
      // Modal window for result section "see details" link
      setTimeout(function () {
          $(document).on('click', '.lt-resultHeadLnkTxt', function () {
              //console.log($(this).parent().parent().find('lf-seeDetailModal'));
              var seeDetailClassNm = this.className.split('');
              var getPhaseID = seeDetailClassNm[seeDetailClassNm.length - 1];
              $('.lf-seeDetailModalPh' + getPhaseID).modal('show');
          });

          $('.lf-seeDetailModalClose').on('click', function () {
              $('.lf-seeDetailModal').modal('hide');
          });
      }, 1000);

  }

  //Calculate button click event
  $('.lf-calculate-btn').on('click', function (e) {
      e.preventDefault();
      let selectedMedPlan = $('#Medical_plan').val();
      let selectedCoverageLvl = $('#Coverage_level').val();
      let selectedSalaryRng = $('#Salary_range').val();

      if ($('.lf-calculator-floating-label').hasClass('lf-calculator-floating-select-error')) {
          $(this).siblings('.mandatoryFld_error').toggleClass('hidden');
      }

      if (selectedMedPlan == "" || selectedMedPlan == null) {
          $('.mandatoryFld_error').removeClass('hidden');
          $('#Medical_plan').parent().addClass('lf-calculator-floating-select-error');
          $('#Coverage_level').parent().addClass('lf-calculator-floating-select-error');
          $('#Salary_range').parent().addClass('lf-calculator-floating-select-error');
          return false;
      } else if (selectedCoverageLvl == "" || selectedCoverageLvl == null) {
          $('#Coverage_level').parent().addClass('lf-calculator-floating-select-error');
          $('#Coverage_level').parent().siblings('.mandatoryFld_error').removeClass('hidden');
          $('#Salary_range').parent().addClass('lf-calculator-floating-select-error');
          $('#Salary_range').parent().siblings('.mandatoryFld_error').removeClass('hidden');
          return false;
      } else if (selectedSalaryRng == "" || selectedSalaryRng == null) {
          $('#Salary_range').parent().addClass('lf-calculator-floating-select-error');
          $('#Salary_range').parent().siblings('.mandatoryFld_error').removeClass('hidden');
          return false;
      } else {
          $('.mandatoryFld_error').addClass('hidden');
          fetchResultItem(selectedMedPlan, selectedCoverageLvl, selectedSalaryRng);
          $('#lf-responseSec').empty().append(lf_responseCont);

          //Analytics implementations
          var cData = new Object();
          cData.events = "event39";
          cData.toolFlowName = "truist|benefits|lifeforce_benefits_calculator"
          cData.toolFlowInfo = "medicalplan:" + selectedMedPlan.trim().replace(/[^a-z0-9\s]/gi, '').replace(/[_\s]/g, '_').toLowerCase() + ",coveragelevel:" + selectedCoverageLvl.trim().replace(/[^a-z0-9\s]/gi, '').replace(/[_\s]/g, '_').toLowerCase() + ",salaryrange:" + selectedSalaryRng.replace(/[^a-z0-9\s]/gi, '').trim().replace(/[_\s]+/g, '_').toLowerCase();
          marTech.trackAction(cData);
      }

  });

  //Reset click event
  $('.lf-reset').on('click', function (e) {
      e.preventDefault();
      $('.mandatoryFld_error').addClass('hidden');
      $('.lf-calculator-floating-label').removeClass('lf-calculator-floating-select-error')
      $('#lf-responseSec').empty();
      $('.lf-calculator-floating-select').val('').attr('value', '');
      $('#Coverage_level').empty();
      $('#Salary_range').empty();
  });

  init_lfCalculator();

  function init_lfCalculator(item) {
      fetchResultItem("BCBSNC PPO $500", "Teammate only", "≤ $49,999");
      setTimeout(function () {
          //Select the first option by default
          $("#Medical_plan").val($("#Medical_plan option:eq(1)").val());
          $("#Coverage_level").val($("#Coverage_level option:eq(1)").val());
          $("#Coverage_level").trigger('click');
          $("#Salary_range").val($("#Salary_range option:eq(1)").val());
          var selected_MedPlan = $("#Medical_plan").find(":selected").val();
          var selected_CoverageLvl = $("#Coverage_level").find(":selected").val();
          var selected_SalRange = $("#Salary_range").find(":selected").val();
          $("#Medical_plan").attr('value', selected_MedPlan);
          $("#Coverage_level").attr('value', selected_CoverageLvl);
          $("#Salary_range").attr('value', selected_SalRange);
          $('.lf-calculate-btn').trigger('click');
      }, 100);
  }
} ) );

