$(function() {
    console.log('pagination called');
    const $PAGINATION = $( '#pagination' );
    const ITEMS_ON_PAGE = ( Number($PAGINATION.attr( "pageLimit" )) || 10 );
    const TOTAL_RESULTS = ( Number($PAGINATION.attr( "totalResults" )) || 0 );	
    const IS_FAQ = $PAGINATION.attr( "isFaq" );
    console.log( 'TOTAL_RESULTS: ' + TOTAL_RESULTS );
    console.log( 'IS_FAQ: ' + IS_FAQ );


    const $RESULT_NUMBER_CONTAINER = $( '#result-number-id' );
    const RESULT_NUMBER_TEMPLATE = $RESULT_NUMBER_CONTAINER.text();

    if ( TOTAL_RESULTS <= ITEMS_ON_PAGE ) {
        $RESULT_NUMBER_CONTAINER.text( CommonUtils.fillTemplate( RESULT_NUMBER_TEMPLATE, [ 1, TOTAL_RESULTS ] ) ).attr({tabindex:"-1",}).focus();;
    	return;  // no need for pagination in this case
       
	}

    $PAGINATION.pagination({
        // Total number of items present
        // in wrapper class
        items: TOTAL_RESULTS,

        // Items allowed on a single page
        itemsOnPage: ITEMS_ON_PAGE,

        displayedPages: 3,
        edges: 1,
        prevText: 'Previous page',
        nextText:'Next page',
        ellipsePageSet: false,

        onPageClick: function (noofele) {
            const START = ITEMS_ON_PAGE * ( noofele - 1 );
            const END = ( ( START + ITEMS_ON_PAGE > TOTAL_RESULTS ) ? TOTAL_RESULTS : START + ITEMS_ON_PAGE );
            if(IS_FAQ === 'true'){
            	$("#accordionResults .card-header").hide().slice( START, END ).show();
               
            } else {
	         	$("#pageAssetResults .list-header").hide().slice( START, END ).show();
            }
            $RESULT_NUMBER_CONTAINER.text(CommonUtils.fillTemplate(RESULT_NUMBER_TEMPLATE, [START + 1, END]));
            $('.simple-pagination li button.prev').text('');
            $('.simple-pagination li button.next').text('');
            if(IS_FAQ  === 'true' ){
	            $('.search-results .accordion .collapse.show').first().removeClass('show');
            } else {
	            $('.search-results .unordered').first().removeClass('show');
            }

            $("#accordionResults").focus();
				setTimeout(function(){$("#result-number-id").attr({tabindex:"-1",}).focus()}, 1500);
        }
    });

    $PAGINATION.pagination('selectPage', 1);	// this method invokes onPageClick handler too, so we don't need to rewrite all the steps to initialize first page
    $('.simple-pagination li button.prev').text('');
    $('.simple-pagination li button.next').text('');
});

'use strict';
window.staticCardTwo =   function() {
const URL_BASE = window.location.origin,
      RATERANGE_URL = new URL( '/content/truist-api/lightstream/raterange.json', URL_BASE ); // TODO - get this one from config // for dynamic
      //RATERANGE_URL = new URL( '/apps/stcom-aem-globalcomponents/components/content/text/clientlibs/js/rate.json', URL_BASE );
let   STATIC_COMP_ROOT, LSC_FACTID_LABEL, lightStreamEnabled, lightStreamPurpose,    
      DAT_FORMAT = new Intl.DateTimeFormat("en-US", {month:'2-digit',day:'2-digit', year:'numeric',hour:'2-digit', minute: '2-digit', hour12:false}),
      actualFactID;      

const _private = {
   init: function(staticComponentStr) {  
        try {
            lightStreamEnabled = staticComponentStr.data("lightstream")? staticComponentStr.data("lightstream") : ''; 
            lightStreamEnabled && CommonUtils.initPlaceholderLinks(staticComponentStr);
            lightStreamEnabled && (_private.doStaticComponentFunctions(staticComponentStr));
        } catch (e){
            console.log("Error : Text component Error with lightstream rates " + e);
        }
   },

   doStaticComponentFunctions: (staticComponentStr) => {
      STATIC_COMP_ROOT = staticComponentStr;
      LSC_FACTID_LABEL = STATIC_COMP_ROOT.data('factid') ? STATIC_COMP_ROOT.data('factidlabel') : '';
      lightStreamPurpose = STATIC_COMP_ROOT.data('loanpurpose') ? STATIC_COMP_ROOT.data('loanpurpose') : '';
    
      _private.getFactID();
      _private.retriveRateRange(); 
      _private.generateLSIParams(); 

   },

   retriveRateRange: async () => {
    const RANGE_SEARCH_PARAMS = {}, RATE_RANGE_RESULT = {};
    let rateRangeList = {}, $clone, minRate, maxRate, rateTimeStamp;
    lightStreamPurpose && (RANGE_SEARCH_PARAMS.purposeCode = lightStreamPurpose) && (RATE_RANGE_RESULT.lsiPurposeCode = lightStreamPurpose);
    LSC_FACTID_LABEL && (RANGE_SEARCH_PARAMS.factId = actualFactID) && (RATE_RANGE_RESULT.lsiFactId = actualFactID);
    try {
       const SETTINGS_RANGE = {url: RATERANGE_URL, data: RANGE_SEARCH_PARAMS, dataType: 'json'}; 
       rateRangeList  = await $.get( SETTINGS_RANGE );
       if (rateRangeList.overallRateRange) {
          rateRangeList.overallRateRange.min && (minRate = parseFloat((rateRangeList.overallRateRange.min*100).toFixed(2)));
          rateRangeList.overallRateRange.max && (maxRate = parseFloat((rateRangeList.overallRateRange.max*100).toFixed(2))); 
          rateRangeList.timeStamp && (rateTimeStamp = DAT_FORMAT.format(new Date(rateRangeList.timeStamp)));
          minRate && (RATE_RANGE_RESULT.lsiMinRate = minRate); maxRate && (RATE_RANGE_RESULT.lsiMaxRate = maxRate);
          $clone = STATIC_COMP_ROOT.clone(true);
          rateTimeStamp && (RATE_RANGE_RESULT.lsiRateDate = rateTimeStamp) && $clone.html(function (i, was) { return _private.fillTemplateDynamicOptional(was, RATE_RANGE_RESULT, true);});
          $clone.html(function (i, was) { return CommonUtils.fillTemplateDynamic(was, RATE_RANGE_RESULT, true);});
          STATIC_COMP_ROOT.empty().html($clone.html()); 
          STATIC_COMP_ROOT.find('.static-lsc-loader').addClass("d-none");
       } else {
           throw new Error("Rate ranage data issue in static card v2");
       }
    }
    catch (e) {
       console.log("lightstream rate range servlet issue in static card v2: " + e)
    }
  },

  generateLSIParams: () => {
   let APPLYNOW_PARAMS = {}, urlParams='', urlLink, urlHash='', finalURL='';
   STATIC_COMP_ROOT.find(".lsiParam").each(function() {
      APPLYNOW_PARAMS = {}, urlParams='', urlLink, urlHash='', finalURL='';
      actualFactID && (APPLYNOW_PARAMS.factID = actualFactID);
      lightStreamPurpose && (APPLYNOW_PARAMS.purposeCode = lightStreamPurpose);
      urlLink = new URL($(this).attr('href'));
      urlParams = new URLSearchParams(urlLink.search);
      for (const [key, value] of urlParams.entries()) {
         APPLYNOW_PARAMS[key] = value;
      }
      urlLink.search = '';
      urlHash = urlLink.hash;
      urlLink.hash = ''; 
      urlParams && (finalURL = urlLink + "?" + $.param(APPLYNOW_PARAMS));
      urlHash && (finalURL = finalURL + urlHash);
      finalURL && $(this).attr('href', finalURL);
    });
 },

   getFactID: () => {
    const urlParams = new URLSearchParams(window.location.search);
    const urlFactID = urlParams.get(LSC_FACTID_LABEL) ?  urlParams.get(LSC_FACTID_LABEL) : false;
    const cookieFactID = _private.getFactIDCookie(LSC_FACTID_LABEL) ? _private.getFactIDCookie(LSC_FACTID_LABEL) : false;
    const nativeFactID = STATIC_COMP_ROOT.data("factid") ? STATIC_COMP_ROOT.data("factid") : false; 
    actualFactID = cookieFactID || urlFactID || nativeFactID;
   },

   getFactIDCookie: (name) => {
        const cookies = document.cookie.split(';');
        for (let i = 0; i < cookies.length; i++) {
        const cookie = cookies[i].trim();
        if (cookie.startsWith(name + '=')) {
            const value = cookie.substring(name.length + 1);
            const expiresIndex = cookie.indexOf('expires=');
            if (expiresIndex !== -1) {
            const expiresDate = new Date(cookie.substring(expiresIndex + 8));
            if (expiresDate > new Date()) {
                return value; 
            }
            } else {
            return value; 
            }
        }
        }
    return null; 
   },

   fillTemplateDynamicOptional: ( templateMarkup = '', replacements = [], collapseBlank = true ) => {
    let tokens = CommonUtils.normalizeWhitespace( templateMarkup ).split( /(<.*?>)/ );
    tokens.forEach( ( token, i ) => {
      var isTag = /^<.*>$/.test( token );
       tokens[i] = token.replace( /{{lsiRateOptional:(.+?)}}/g, ( m, p1 ) => {
          let repl = "{{lsiRateOptional}}";
          replacements.lsiRateOptional = p1.substring(18, p1.indexOf('}'));
          return (
             ( isTag ? repl.replace( /<.*?>/g, '' ) : repl ) ||   // avoid putting tags inside other tags
             ( collapseBlank ? '' : m )
          );
       } );
    } );
    return tokens.join( '' );
  }
};
  
const _public = {
        init: _private.init,
};
return _public;       
}; 



