$(() => {
   const THIS_FORM = $('.mma-banner-modal-form'), // *** $('.your-form-class')   -OR-   $('#your-form-id') ***//
      FORM_GROUP = $(THIS_FORM).find('.form-group'),
      LABEL = $(FORM_GROUP).find('label'),
      TXT_INPUT = $(THIS_FORM).find('#zip'),
      ERROR = $('.validation-message:not(.chars):not(.failed)'),
      ERROR2 = $('.validation-message.chars'),
      ERROR3 = $('.validation-message.failed'),
      CLEAR = document.querySelectorAll('.clear-field-button');

      CLEAR.forEach((btn) => {
         let btnSRtext = $(btn).closest(FORM_GROUP).find(LABEL).text().trim();
         btnSRtext = btnSRtext.slice(0, btnSRtext.length);
         $(btn).closest('.input-wrapper').addClass('has-clear');
         $(btn).attr({
            'aria-label': "Clear " + btnSRtext + " input field",
         });
      });

      $(TXT_INPUT).on('focus', function () {
         $(this).closest(FORM_GROUP).find(LABEL).addClass('is-focused');
         if ($(this).val() !== "") {
            $(this).addClass('has-clear').closest(FORM_GROUP).find(CLEAR).attr({
               'tabindex': "0"
            }).show();
            $(this).css('width', 'calc(100% - 91px)');
         } else {
            $(this).removeClass('has-clear').closest(FORM_GROUP).find(CLEAR).attr({
               'tabindex': "-1"
            }).hide();
            $(this).css('width', 'calc(100% - 53px)');
         }
      }).on('blur', function () {
            if($(this).val() === "") {
            $(this).closest(FORM_GROUP).find(CLEAR).hide().attr('tabindex', '-1');
            $(this).closest(FORM_GROUP).find('.iconbox').attr('tabindex', '-1');
            $(this).css('width', 'calc(100% - 53px)');
         } else if ($(this).val() !== "") {
            $(this).closest(FORM_GROUP).find(CLEAR).show().attr('tabindex', '0');
            $(this).closest(FORM_GROUP).find('.iconbox').attr('tabindex', '-1');
            $(this).closest(FORM_GROUP).find(LABEL).removeClass('is-focused');
            $(this).css('width', 'calc(100% - 91px)');
         }
      }).on('keyup', function () {
         if ($(this).val() !== "") {
            $(this).addClass('has-clear').closest(FORM_GROUP).find(CLEAR).attr({
               'tabindex': "0"
            }).show();
            $(this).css('width', 'calc(100% - 91px)');
         } else if ($(this).val() === "") {
            $(this).closest(FORM_GROUP).find(CLEAR).hide();
            $(this).css('width', 'calc(100% - 53px)');
         }
      });

      $(CLEAR).on('blur', function () {
         if ($(this).closest('.input-wrapper').find('input').val() !== "" && !$(this).closest('.input-wrapper').find('input').hasClass('validation-failed')) {
            $(this).attr('tabindex', '0');
         } else if ($(this).closest('.input-wrapper').find('input').val() !== "" && $(this).closest('.input-wrapper').find('input').hasClass('validation-failed')) {
            $(this).show().attr('tabindex', '0');
         } else if ($(this).closest('.input-wrapper').find('input').val() === "" && !$(this).closest('.input-wrapper').find('input').hasClass('validation-failed')) {
            $(this).hide().attr('tabindex', '-1');
         } else if ($(this).closest('.input-wrapper').find('input').val() === "" && $(this).closest('.input-wrapper').find('input').hasClass('validation-failed')) {
            $(this).hide().attr('tabindex', '-1');
         }
      }).on('click', function () {
         $(this).closest(FORM_GROUP).find(ERROR).hide();
         $(this).closest(FORM_GROUP).find(ERROR2).hide();
         $(this).closest(FORM_GROUP).find(ERROR3).hide();
         $(this).attr('tabindex', '-1').closest('.input-wrapper').removeClass('has-error').find('input').removeClass('validation-failed').removeAttr('invalid aria-invalid').attr('aria-describedby', 'zip-hint').val("").focus();
         $(this).closest(FORM_GROUP).find(LABEL).removeClass('has-error');
         $(this).closest(FORM_GROUP).find('.input-hint').show();
      });
})

