        let combinedStandardRates = [...NEW_RATES1_ARR, ...NEW_RATES2_ARR];
        // console.log("combinedStandardRates = ", combinedStandardRates);
        combinedStandardRates = JSON.stringify(combinedStandardRates);
        let allRates = JSON.parse(combinedStandardRates);
        // console.log('allRates = ', allRates);
        return allRates;
