   fillTemplateDynamicOptional: ( templateMarkup = '', replacements = [], collapseBlank = true ) => {
      let tokens = CommonUtils.normalizeWhitespace( templateMarkup ).split( /(<.*?>)/ );
      tokens.forEach( ( token, i ) => {
        var isTag = /^<.*>$/.test( token );
         tokens[i] = token.replace( /{{lsiRateOptional:(.+?)}}/g, ( m, p1 ) => {
            let repl = "{{lsiRateOptional}}";
            replacements.lsiRateOptional = p1.substring(18, p1.indexOf('}'));
            return (
               ( isTag ? repl.replace( /<.*?>/g, '' ) : repl ) ||   // avoid putting tags inside other tags
               ( collapseBlank ? '' : m )
            );
         } );
      } );
      return tokens.join( '' );
    },

   getFactID: () => {
      const urlParams = new URLSearchParams(window.location.search);
      const urlFactID = urlParams.get(LSC_FACTID_LABEL) ?  urlParams.get(LSC_FACTID_LABEL) : false;
      const cookieFactID = _private.getFactIDCookie(LSC_FACTID_LABEL) ? _private.getFactIDCookie(LSC_FACTID_LABEL) : false;
      const nativeFactID = LSC_COMP_ROOT.attr("data-factid") ? LSC_COMP_ROOT.attr("data-factid") : false;
      actualFactID = cookieFactID || urlFactID || nativeFactID;
   },

   getFactIDCookie: (name) => {
      const cookies = document.cookie.split(';');
      for (let i = 0; i < cookies.length; i++) {
        const cookie = cookies[i].trim();
        if (cookie.startsWith(name + '=')) {
          const value = cookie.substring(name.length + 1);
          const expiresIndex = cookie.indexOf('expires=');
          if (expiresIndex !== -1) {
            const expiresDate = new Date(cookie.substring(expiresIndex + 8));
            if (expiresDate > new Date()) {
              return value; 
            }
          } else {
            return value; 
          }
        }
      }
     return null; 
   },

